ed products.%2$s'=>'Апсейлы — это, как правило, наиболее прибыльные, качественные или дорогие товары. Пробуйте различные комбинации, чтобы поднять продажи. %1$sПодробнее о сопутствующих товарах.%2$s','Include downloads'=>'Включить загрузки','Linked products'=>'Сопутствующие товары','Unable to start synchronization. The link you followed may have expired.'=>'Не удается запустить синхронизацию. Вероятно, срок действия ссылки, по которой вы перешли, истёк.','Customer Email'=>'Адрес электронной почты клиента','You do not have permission to manage logging settings.'=>'У вас нет прав на управление настройками ведения журнала.','Database settings'=>'Настройки базы данных','Log entries are stored in this database table: %s'=>'Записи журнала хранятся в этой таблице базы данных: %s','File system settings'=>'Настройки файловой системы','⚠️ This directory does not appear to be writable.'=>'⚠️ Директория недоступна для записи.','Log files are stored in this directory: %s'=>'Файлы журнала, хранимые в этой директории: %s','This sets the minimum severity level of logs that will be stored. Lower severity levels will be ignored. "None" means all logs will be stored.'=>'Этот параметр определяет минимальный уровень серьёзности записей журнала, которые будут храниться. Записи журналов более низкого уровня серьёзности будут игнорироваться. «Нет» означает, что храниться будут все журналы.','Level threshold'=>'Порог уровня','This setting cannot be changed here because it is defined in the %1$s constant, probably in your %2$s file.'=>'Этот параметр невозможно изменить здесь, поскольку он определён в константе %1$s, скорее всего в файле %2$s.','This sets how many days log entries will be kept before being auto-deleted.'=>'Этот параметр определяет, сколько дней будут храниться записи журналов до автоматического удаления.','Retention period'=>'Срок хранения','This setting cannot be changed here because it is being set by a filter on the %s hook.'=>'Этот параметр невозможно изменить здесь, поскольку он определяется фильтром хука действия %s.','This determines where log entries are saved.'=>'Этот параметр определяет, где хранятся записи журнала.','Log storage'=>'Хранилище записей журнала','This setting cannot be changed here because it is defined in the %s constant.'=>'Этот параметр невозможно изменить здесь, поскольку он определён в константе %s.','Note that if this setting is changed, any log entries that have already been recorded will remain stored in their current location, but will not migrate.'=>'Обратите внимание, что, если этот параметр будет изменён, все существующие записи журнала сохранятся в текущем местоположении и не будут перенесены.','Database (not recommended on live sites)'=>'База данных (не рекомендуется для действующих сайтов)','File system (default)'=>'Файловая система (по умолчанию)','Logger'=>'Регистратор','Logs settings'=>'Параметры журнала','Logging is disabled. It can be enabled in <a href="%s">Logs Settings</a>.'=>'Ведение журнала отключено. Его можно включить в <a href="%s">настройках журнала</a>.','%1$s log file from source %2$s was deleted.'=>'Файлы журнала (%1$s) из источника %2$s были удалены.' . "\0" . 'Файлы журнала (%1$s) из источника %2$s были удалены.' . "\0" . 'Файлы журнала (%1$s) из источника %2$s были удалены.','Differences found for order %d:'=>'В заказе %d найдены отличия:','No differences found.'=>'Отличий не найдено.','An error occurred while computing a diff for order %1$d: %2$s'=>'Произошла ошибка при вычислении разницы для заказа %1$d: %2$s','Orders subject to cleanup: %d'=>'Заказы, подлежащие очистке: %d','Unsynced orders: %d'=>'Несинхронизированные заказы: %d','Compatibility mode enabled?: %s'=>'Режим совместимости включён? %s','HPOS enabled?: %s'=>'HPOS включено? %s','Select stock statuses'=>'Выбрать статус наличия на складе','Select ratings'=>'Выбрать рейтинги','Select a rating'=>'Выбрать рейтинг','Minimal'=>'Минимальный','A link to a product sold on a different website, e.g. brand collab.'=>'Ссылка на т