nt/flat-rate-shipping/#shipping-classes">настройке тарифов на доставку различными классами</a>.','e.g. Standard national'=>'например, стандартный федеральный','Your customers will see the name of this shipping method during checkout.'=>'Ваши клиенты увидят название этого способа доставки во время оформления заказа.','advanced costs'=>'дополнительных затратах','Charge a flat rate per item, or enter a cost formula to charge a percentage based cost or a minimum fee. Learn more about'=>'Взимайте фиксированную ставку за единицу товара или введите формулу стоимости, чтобы вычислять стоимость в процентах или брать минимальную комиссию. Узнать больше о','Attribute terms.'=>'Значения атрибута.','WooCommerce Store Identifier.'=>'Идентификатор магазина WooCommerce.','Add to cart: &ldquo;%s&rdquo;'=>'Добавить в корзину &ldquo;%s&rdquo;','An optional zone you can use to set the shipping method(s) available to any regions that have not been listed above.'=>'Дополнительная зона, которую можно использовать для настройки способов доставки, доступных для любых регионов, которые не были перечислены выше.','A shipping zone consists of the region(s) you\'d like to ship to and the shipping method(s) offered. A shopper can only be matched to one zone, and we\'ll use their shipping address to show them the methods available in their area.'=>'Зона доставки состоит из регионов, в которые будут отправляться заказы, и предлагаемых способов доставки. Покупатель может быть привязан только к одной зоне, его адрес доставки будет использован для отображения ему способов, доступных в его регионе.','Add zone'=>'Добавить зону','STEP 1 OF 2'=>'Шаг 1 из 2','Create shipping method'=>'Создать способ доставки','STEP 2 OF 2'=>'Шаг 2 из 2','Add shipping class costs'=>'Добавьте стоимость класса доставки','Set up %s'=>'Настроить "%s"','Add the shipping methods you\'d like to make available to customers in this zone.'=>'Добавьте способы доставки, которые нужно сделать доступными для клиентов в этой зоне.','List