y again.'=>'Произошла ошибка при подключении подписки. Повторите попытку.','Your subscription has been connected.'=>'Ваша подписка подключена.','"%1$s" was removed from the cart. %2$s'=>'"%1$s" удалён из корзины. %2$s','block descriptionDisplays WooCommerce page content.'=>'Отображение содержимого страницы WooCommerce.','block titleWooCommerce Page'=>'Страница WooCommerce','block descriptionDisplay the items purchased and order totals.'=>'Отображение приобретённых товаров и итоговых сумм заказа.','block titleOrder Totals'=>'Итоговые суммы заказа','block descriptionDisplay the order details section.'=>'Отображение раздела сведений о заказе.','block titleOrder Totals Section'=>'Раздел итоговых сумм заказа','block descriptionDisplay the order summary on the order confirmation page.'=>'Отображение сводки заказа на странице подтверждения деталей.','block descriptionDisplay a "thank you" message, or a sentence regarding the current order status.'=>'Отображение сообщения с выражением благодарности или предложением, касающимся текущего статуса заказа.','block titleOrder Status'=>'Статус заказа','block descriptionDisplay the order confirmation shipping section.'=>'Отображение раздела отправки при подтверждении заказа.','block titleShipping Address Section'=>'Раздел адреса доставки','block descriptionDisplay the order confirmation shipping address.'=>'Отображение адреса доставки при подтверждении заказа.','block descriptionDisplay links to purchased downloads.'=>'Отображение ссылок на приобретённые скачиваемые файлы.','block titleOrder Downloads'=>'Скачивания заказа','block descriptionDisplay the downloadable products section.'=>'Отображение раздела скачиваемых продуктов.','block titleDownloads Section'=>'Раздел скачиваний','block descriptionDisplay the order confirmation billing section.'=>'Отображение раздела оплаты подтверждения заказа.','block titleBilling Address Section'=>'Раздел платёжного адреса','block descriptionDisplay the order confirmation billing address.'=>'Отображение платёжного адреса при подтверждении заказа.','block descriptionDisplays additional information provided by third-party extensions for the current order.'=>'Отображение дополнительной информации, предоставленной сторонними расширениями для текущего заказа.','block titleAdditional Information'=>'Дополнительная информация','block descriptionEnable customers to filter the product collection by choosing a price range.'=>'Фильтрация ассортимента товаров, в соответствии с ценовым диапазоном.','block keywordFilters'=>'Фильтры','block descriptionA block that adds product filters to the product collection.'=>'Блок, добавляющий фильтры в коллекцию товаров.','block descriptionRenders classic WooCommerce shortcodes.'=>'Отображает классические шорткоды WooCommerce.','block titleClassic Shortcode'=>'Классический шорткод','block keyworddownloads'=>'скачивания','block descriptionThe product downloads.'=>'Скачивания определённого товара.','block titleProduct downloads'=>'Скачивания товара','block keywordtext'=>'текст','block descriptionA text field for use in the product editor.'=>'Текстовое поле для использования в редакторе товара.','block titleProduct text field'=>'Текстовое поле товара','block keywordnumber'=>'количество','block descriptionA reusable number field for the product editor.'=>'Многоразовое числовое поле редактора товара.','block titleProduct number control'=>'Контроль количества товара','block descriptionA reusable checkbox for the product editor.'=>'Многоразовая галочка редактора товара.','days'=>'дн.','View all'=>'Показать все','Search results'=>'Результаты поиска','Sync %s pending order'=>'Синхронизировать %s отложенный заказ' . "\0" . 'Синхронизировать %s отложенных заказа' . "\0" . 'Синхронизировать %s отложенных заказов','Background sync is enabled.'=>'Включена фоновая синхронизация.','Add and manage attributes used for product options, such as size and color.'=>'Добавляйте и изменяйте атрибуты, используемые для параметров товара, такие как размер и цвет.','This product requires shipping or pickup'=>'Этот товар требует доставки или самовывоза','This variation requires shipping or pickup'=>'Эта вариация требует доставки или самовывоза','Same as main product'=>'Так же как у основного товара','Variation details'=>'Детали вариации','<strong>You’re editing details specific to this variation.</strong> Some information, like description and images, will be inherited from the main product, <noticeLink><parentProductName/></noticeLink>.'=>'<strong>Вы редактируете детали, характерные для данной вариации</strong>. Некоторая информация, такая как описание и изображения, будет унаследована от основного товара <noticeLink><parentProductName/></noticeLink>.','Template for the product variation form'=>'Шаблон формы вариации товара','Product Variation Template'=>'Шаблон вариации товара','Good news! WooCommerce Tax can automate your sales tax calculations for you.'=>'Хорошие новости! WooCommerce Tax может автоматизировать расчёты налога с продаж за вас.','The Order Confirmation template serves as a receipt and confirmation of a successful purchase. It includes a summary of the ordered items, shipping, billing, and totals.'=>'Шаблон подтверждения заказа выполняет функцию квитанции и подтверждает успешное оформление покупки. Он включает в себя сводную информацию о заказанных товарах, доставке, выставления счёта и итоговых суммах.','Template namePage: Checkout'=>'Страница: Оформление заказа','Template namePage: Cart'=>'Страница: Корзина','The item type.'=>'Тип объекта.','You are not allowed to make this request. Please make sure you are logged in.'=>'Вам не разрешено отправлять такие запросы. Убедитесь, что вы вошли в систему.','The business description for a given store.'=>'Описание компании данного магазина.','Failed to fetch dummy products.'=>'Не удалось получить демонстрационные товары.','No business description provided for generating AI content.'=>'Для генерации текста ИИ не представлено описание компании.','Failed to update patterns content.'=>'Не удалось обновить содержимое шаблонов.','Failed to set the pattern content.'=>'Не удалось установить содержимое шаблона.','Failed to set the pattern images.'=>'Не удалось установить изображения шаблона.','The patterns dictionary is missing.'=>'Словарь шаблонов отсутствует.','The search term definition failed.'=>'Не удалось определить поисковый запрос.','Make sure cart and checkout flows are configured correctly for your shoppers.'=>'Убедитесь, что механизмы работы корзины и оформления заказа работают корректно при взаимодействии с покупателями.','Confirm email and view order'=>'Подтвердите адрес электронной почты и просмотрите заказ','Alternatively, confirm the email address linked to the order below.'=>'В качестве альтернативы, подтвердите адрес электронной почты, указанный в приведённом ниже заказе.','Have an account with us? %1$sLog in here%2$s to view your order.'=>'У вас есть учётная запись на нашем сайте? %1$sВойдите сюда%2$s, чтобы просмотреть детали заказа.','Great news! Your order has been received, and a confirmation will be sent to your email address.'=>'Отличные новости! Ваш заказ зарегистрирован, и на ваш адрес электронной почты будет отправлено подтверждение.','Have an account with us? %1$sLog in here to view your order details%2$s.'=>'У вас есть учётная запись на нашем сайте? %1$sВойдите сюда, чтобы просмотреть детали заказа%2$s.','If you\'ve just placed an order, give your email a quick check for the confirmation.'=>'Если вы только что разместили заказ, проверьте свой электронный почтовый ящик для его подтверждения.','Please check your email for the order confirmation.'=>'Пожалуйста, проверьте свою электронную почту для подтверждения заказа.','Try again'=>'Попробовать снова','Your order cannot be processed as the originating bank/merchant has declined your transaction. Please attempt your purchase again.'=>'Ваш заказ не может быть обработан, поскольку банк/продавец отклонил вашу транзакцию. П