тите миллиард пользователей по всему миру с помощью %1$sTikTok для WooCommerce%2$s','Migrate command is deprecated. Please use `sync` instead.'=>'Команда миграции устарела. Вместо неё используйте «sync».','Sync completed.'=>'Синхронизация завершена.','No orders were synced.'=>'Заказы не были синхронизированы.','block descriptionEnable customers to filter the product grid by stock status.'=>'Разрешить клиентам фильтровать сетку по состоянию запасов товаров.','block titleFilter Block'=>'Блок фильтрации','block descriptionEnable customers to filter the product grid by choosing a price range.'=>'Позвольте клиентам фильтровать сетку продуктов, выбирая ценовой диапазон.','block descriptionContains blocks that display the content of the Mini-Cart.'=>'Содержит блоки, отображающие содержимое мини-корзины.','block descriptionHighlight a product or variation.'=>'Выделение товара или вариации.','block descriptionEnable customers to filter the product grid by selecting one or more attributes, such as color.'=>'Разрешить клиентам фильтровать сетку товаров по одному или нескольким атрибутам, например по цвету.','block descriptionDisplay the currently active filters.'=>'Отображение текущих активных фильтров.','Select %s'=>'Выберите %s','List price'=>'Розничная цена','Process your orders on the go. %1$sGet the app%2$s.'=>'Работать с заказами можно в %1$sприложении%2$s.','%1$sManage the order%2$s with the app.'=>'%1$sУправляйте заказом%2$s с помощью приложения.','%1$sCollect payments easily%2$s from your customers anywhere with our mobile app.'=>'%1$sПолучайте платежи без проблем%2$s от своих клиентов где угодно с помощью нашего мобильного приложения.','Something went wrong when trying to restore order %d from the trash. It could not be restored.'=>'Что-то пошло не так при попытке восстановить заказ %d из мусорной корзины. Его восстановить невозможно.','The previous status of order %1$d ("%2$s") is invalid. It could not be restored.'=>'Предыдущий статус заказа %1$d ("%2$s") недействителен. Его восстановить невозможно.','The previous status of order %1$d ("%2$s") is invalid. It has been restored to "pending" status instead.'=>'Предыдущий статус заказа %1$d ("%2$s") недействителен. Он был переведён в статус "на утверждении".','Order %1$d cannot be restored from the trash: it has already been restored to status "%2$s".'=>'Заказ %1$d нельзя восстановить из мусорной корзины: он уже был переведен в статус "%2$s".','Get the free WooCommerce mobile app'=>'Получить бесплатное приложение WooCommerce','Whether or not this store country is set via onboarding profiler.'=>'Указана страна для этого магазина в мастере установки или нет.','Registers whether the note is read or not'=>'Регистрирует, прочли примечание или нет','Jetpack is not connected.'=>'Jetpack не подключён.','“New Account” emails are sent when a customer signs up via the checkout flow.'=>'Эл. письма "Новая учётная запись" отправляются, когда клиент регистрируется во время оформления заказа.','Empty Mini-Cart Message'=>'Сообщение о пустой мини-корзине','Ensure meta_data excludes specific keys.'=>'Убедитесь, что meta_data исключает определённые ключи.','Limit meta_data to specific keys.'=>'Укажите в meta_data только определённые ключи.','Unsupported argument type provided as value.'=>'В качестве значения указан неподдерживаемый тип аргумента.','Invalid password. Generate a new one from %s.'=>'Неверный пароль. Создайте новый в %s.','Connection password:'=>'Пароль для подключения:','If you don\'t have an application password (not your account password), generate a password from %s'=>'Если у вас нет пароля для приложения (это не пароль для вашей учётной записи), создайте его в %s','Your store is already connected.'=>'Ваш магазин уже подключён.','Are you sure you want to disconnect your store from WooCommerce.com?'=>'Вы действительно хотите отключить свой магазин от WooCommerce.com?','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'Ваш магазин не подключен к WooCommerce.com. Запустите команду "wp wc com connect".','Customers can still save the file to their device, but by default file will be opened instead of being downloaded (does not work with redirects).'=>'Клиенты могут по-прежнему сохранить файл на своём устройстве, но по умолчанию файл будет открыт, а не загружен (не работает с переадресацией).','Open downloadable files in the browser, instead of saving them to the device.'=>'Открывайте загружаемые файлы в браузере, вместо того чтобы сохранять их на устройстве.','Open in browser'=>'Открыть в браузере','Summarize this product in 1-2 short sentences. We’ll show it at the top of the page.'=>'Опишите этот товар с помощью 1–2 коротких предложений. Это описание будет отображаться в верхней части страницы.','Describe this product. What makes it unique? What are its most important features?'=>'Опишите этот товар. Что делает его уникальным? Каковы его наиболее важные особенности?','Product types define available product details and attributes, such as downloadable files and variations. They’re also used for analytics and inventory management.'=>'Типы товара определяют доступные особенности товара и атрибуты, например загружаемые файлы и вариации. Они также используются для аналитики и управления запасами.','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>Вариативный —</b> товар с вариациями, каждая из которых может иметь свои артикул, цену, опции и т. д. Например, футболки могут быть разных цветов и/или размеров.','<b>External or Affiliate –</b> one that you list and describe on your website but is sold elsewhere.'=>'<b>Внешний или аффилированный —</b> товар, который вы указываете и описываете на своём веб-сайте, но продаётся в другом месте.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.'=>'<b>Сборный —</b> коллекция связанных товаров, которые можно приобрести по-отдельности и которые включат в себя только простые товары. Например, набор из шести стеклянных бокалов.','<b>Simple –</b> covers the vast majority of any products you may sell. Simple products are shipped and have no options. For example, a book.'=>'<b>Простой —</b> подходит для большинства товаров, которые можно продавать. Простые товары могут быть доставлены и не имеют опций. Например, книга.','Sofia District'=>'Sofia District','block descriptionDisplay products from your store in a grid layout.'=>'Отображение товаров магазина в виде сетки.','block titleAll Products'=>'Все товары','block descriptionDisplay a grid of products from your selected categories.'=>'Отображение сетки товаров из отмеченных категорий.','block titleProducts by Category'=>'Товары по категории','block descriptionShow all product categories as a list or dropdown.'=>'Отображение всех категорий товаров в виде выпадающего списка.','block titleProduct Categories List'=>'Список категорий товаров','block descriptionDisplay a grid of your all-time best selling products.'=>'Отображение сетки самых продаваемых товаров магазина за всё время.','block titleBest Selling Products'=>'Самые продаваемые товары','You cannot edit this item because it is in the Trash. Please restore it and try again.'=>'Невозможно изменить этот элемент, так как он находится в корзине. Восстановите его и повторите попытку.','This info will be displayed on the product page, category pages, social media, and search results.'=>'Эти данные будут показываться на странице товара, страницах рубрик, в социальных сетях и в результатах поиска.','Buy one of this item'=>'Купить один такой товар','Postcode / ZIP:'=>'Почтовый индекс:','City:'=>'Город:','Country / region:'=>'Страна/регион:','Thumbnail image'=>'Миниатюра','Invalid table id: %s.'=>'Недопустимый id таблицы: %s.','Can not re-use table alias "%s" in OrdersTableQuery.'=>'Невозможн