eleting any such files.'=>'В вашем каталоге загрузок обнаружены файлы, которые могут содержать отчёты %1$sаналитики магазина%2$s. Рекомендуем оперативно просматривать и удалять все подобные файлы.','Potentially unsecured files were found in your uploads directory'=>'В вашем каталоге загрузок обнаружены потенциально незащищённые файлы','Update the table directly upon product changes, instead of scheduling a deferred update.'=>'Обновлять таблицу непосредственно при изменении товара, вместо того, чтобы планировать отложенное обновление.','Direct updates'=>'Прямые обновления','Use the product attributes lookup table for catalog filtering.'=>'Используйте таблицу обзора атрибутов товара для фильтрации каталога.','Enable table usage'=>'Включить использование таблицы','These settings are not available while the lookup table regeneration is in progress.'=>'Эти настройки недоступны во время регенерации таблицы обзора.','Product attributes lookup table'=>'Таблица обзора атрибутов товара','Select a product to regenerate the data for, or leave empty for a full table regeneration:'=>'Выберите товар для регенерации данных или оставьте поле пустым для полной регенерации таблицы:','Additional data to pass to the extension'=>'Дополнительные данные для передачи расширению','Extension\'s name - this will be used to ensure the data in the request is routed appropriately.'=>'Название расширения - будет использоваться для обеспечения правильной маршрутизации данных в запросе.','Enable WooCommerce Analytics'=>'Включение аналитики WooCommerce','N. Revenue (formatted)'=>'Чистый доход (формат.)','Net total revenue (formatted).'=>'Чистый общий доход (форматированный).','When true, refunded items are restocked.'=>'Если подтверждено, возвращённые товары пополняются.','Shipping Phone Number'=>'Номер телефона для доставки','Billing Phone Number'=>'Номер телефона плательщика','Page titleRefund and Returns Policy'=>'Политика возврата','Page slugrefund_returns'=>'refund_returns','%1$s at %2$s %3$s'=>'%1$s в %2$s %3$s','Edit page'=>'Редактировать страницу','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'Мы создали для вас образец страницы возврата. Пожалуйста, посмотрите и обновите его содержимое, чтобы оно соответствовало процессам вашей компании.','Setup a Refund and Returns Policy page to boost your store\'s credibility.'=>'Настройте страницу политики возврата, чтобы повысить доверие к вашему магазину.','Print discounted USPS and DHL labels straight from your WooCommerce dashboard and save on shipping.'=>'Печатайте этикетки USPS и DHL со скидкой прямо из панели управления WooCommerce и экономьте на доставке.','Save time and money with WooCommerce Shipping'=>'Экономьте время и деньги с Доставкой WooCommerce','Limit result set to products that are low or out of stock. (Deprecated)'=>'Ограничить набор результатов товарами, которых мало или нет в наличии (не рекомендуется).','%1$s could not be served using the Force Download method. A redirect will be used instead.'=>'%1$s не может использоваться применяя принудительную загрузку. Вместо этого будет использоваться переадресация.','%1$s could not be served using the X-Accel-Redirect/X-Sendfile method. A Force Download will be used instead.'=>'%1$s не может использоваться применяя X-Accel-Redirect/X-Sendfile. Вместо этого будет использоваться принудительная загрузка.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Если выбрана принудительная загрузка или «X-Accel-Redirect/X-Sendfile», но она не работает, система будет использовать метод переадресации в крайнем случае. Смотрите <a href="%1$s">это руководство</a> для получения более подробной информации.','Allow using redirect mode (insecure) as a last resort'=>'Разрешить использовать режим переадресации (небезопасно) в крайнем случае','Set your store location and where you\'ll ship to.'=>'Укажите местоположение магазина и регионы доставки.','Choose payment providers and enable payment methods at checkout.'=>'Выберите платёжные системы и способы оплаты для оформления заказов.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Остался один шаг до начала приёма платежей. Проверьте сведения о вашей компании, чтобы начать управлять транзакциями с помощью WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Для начала добавьте в магазин первый товар. Можно добавлять товары вручную, через CSV или импортировать их из другой службы.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Адрес магазина необходим, чтобы установить страну для настройки доставки, валюты и платежей.','Set your store location and configure tax rate settings.'=>'Укажите местоположение магазина и настройте ставку налога.','Good choice! You chose to add %1$s and %2$s to your store.'=>'Хороший выбор! Вы решили добавить %1$s и %2$s в магазин.','Grow your store'=>'Развивайте свой магазин','The rate at which tax is applied.'=>'Применяемая ставка налога.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'Заметки недоступны, поскольку невозможно загрузить данные хранилища «admin-note».','Get backups'=>'Получить резервные копии','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Сбои в работе магазина приводят к потере прибыли. Восстановление одним щелчком позволяет быстро вернуться к работе, если что-то выходит из строя.','Protect your WooCommerce Store with Jetpack Backup.'=>'Защитите свой магазин WooCommerce с помощью Jetpack Backup.','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Расширение Payfast для WooCommerce позволяет принимать платежи по кредитной карте и путём безналичных переводов через один из самых популярных платёжных шлюзов в Южной Африке. Вам не потребуется платить за установку или ежемесячно оплачивать подписку. Если выбрать это расширение, в качестве валюты в магазине будет использоваться южноафриканский рэнд.','Number of variation items sold.'=>'Количество проданных вариаций товара.','Variations Sold'=>'Вариантов продано','Number of product items sold.'=>'Количество проданных товаров.','Products sold'=>'Товаров продано','Source of note.'=>'Источник заметки.','Data store:'=>'Хранилище данных:','This section shows details of Action Scheduler.'=>'В этом разделе показаны сведения о планировщике действий.','Products by Rating list'=>'Товары по рейтинговому списку','Recently Viewed Products list'=>'Список недавно просмотренных товаров','Change status to cancelled'=>'Установить статус «отменён»','Download %d ID'=>'ID загрузки %d','Things to do next'=>'Что делать дальше','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'Управляйте транзакциями, не выходя из панели инструментов WordPress. Только с WooPayments.','Create and send purchase follow-up emails, newsletters, and promotional campaigns straight from your dashboard.'=>'Создавайте и отправляйте электронные письма о покупке, новостные сообщения и рекламные кампании прямо в панели управления сайтом.','Invalid path provided.'=>'Предоставлен неверный путь.','How easy was it to add a product tag?'=>'Насколько легко было добавить метку товара?','A link to a product.'=>'Ссылка на товар.','Product Link'=>'Ссылка товара','A link to a product tag.'=>'Ссылка на метку товара.','Product Tag Link'=>'Ссылка метки товара','A link to a product category.'=>'Ссылка на категорию товара.','Product Category Link'=>'Ссылка категории товара','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Чтобы письма с уведомлениями магазина поступали вам и вашим клиентам, рекомендуем подключить адрес электронной почты к вашему домену и настроить выделенный SMTP-сервер. Если похоже, что сообщения не отправляются корректно, установите <a href="%1$s">плагин регистрации почты WP</a> или изучите <a href="%2$s">страницу часто задаваемых вопросов по электронной почте</а>.','Delta Amacuro'=>'Дельта-Амакуро','Federal Dependencies'=>'Федеральные владения','Zulia'=>'Сулия','Yaracuy'=>'Яракуй','Trujillo'=>'Трухильо','Táchira'=>'Тачира','Sucre'=>'Сукре','Portuguesa'=>'Португеса','Nueva Esparta'=>'Нуэва-Эспарта','Monagas'=>'Монагас','Miranda'=>'Миранда','Mérida'=>'Мерида','Lara'=>'Лара','Guárico'=>'Гуарико','Falcón'=>'Фалькон','Cojedes'=>'Кохедес','Carabobo'=>'Карабобо','Bolívar'=>'Боливар','Barinas'=>'Баринас','Aragua'=>'Арагуа','Apure'=>'Апуре','Anzoátegui'=>'Ансоатеги','Capital'=>'Столичный округ','Filling in progress (%d)'=>'Заполнение в процессе (%d)','Product attributes lookup table data is regenerating'=>'Данные таблицы обзора атрибутов товара регенерируются','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'Этот механизм регенерирует данные таблицы обзора атрибутов товара из данных существующих товаров. Данный процесс может занять некоторое время.','Regenerate the product attributes lookup table'=>'Регенерировать таблицу обзора атрибутов товара','Paystack helps African merchants accept one-time and recurring payments online with a modern, safe, and secure payment gateway.'=>'Paystack помогает африканским торговцам принимать разовые и повторяющиеся платежи с помощью современного безопасного платежного шлюза.','Paystack'=>'Paystack','%s connected successfully'=>'%s подключен успешно','MailPoet'=>'MailPoet','How easy was it to add a product attribute?'=>'Насколько легко было добавить атрибут товаров?','How easy was it to add product category?'=>'Насколько легко было добавить категорию товаров?','How easy was it to use search?'=>'Насколько легко было использовать поиск?','Nice one; you\'ve created a WooCommerce store! Now it\'s time to add your first product and get ready to start selling.%s'=>'Симпатяга; вы создали магазин WooCommerce! Пришло время добавить свой первый товар и приготовиться к продажам.%s','Hi there,'=>'Привет,','%s (optional)'=>'%s (необязательно)','Enable PayU’s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Включите эксклюзивный плагин PayU для WooCommerce, чтобы начать принимать платежи более чем 100 способами оплаты, доступными в вашей стране, включая кредитные карты, дебетовые карты, UPI и многое другое!','PayU for WooCommerce'=>'PayU для WooCommerce','Get ready to start selling'=>'Будьте готовы к началу продаж','Block name is required.'=>'Требуется название блока.','%1$s and %2$s'=>'%1$s и %2$s','Integration "%s" is not registered.'=>'Интеграция «%s» не зарегистрирована.','"%s" is already registered.'=>'«%s» уже зарегистрирован.','Integration registry requires an identifier.'=>'Реестр интеграции требует идентификатора.','There was an error with an item in your cart.'=>'Произошла ошибка с товаром в вашей корзине.','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'%s заканчиваются на складе. Уменьшите количество в вашей корзине.','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'%s заканчивается н