erce 5.3.','List of postcodes / ZIPs. Introduced in WooCommerce 5.3.'=>'Список почтовых индексов. Представлен в WooCommerce 5.3.','Amount that will be refunded for this tax.'=>'Сумма, которая будет возвращена по этому налогу.','Amount that will be refunded for this line item (excluding taxes).'=>'Сумма, которая будет возвращена по данной позиции (без учёта налогов).','Low Stock amount for the variation.'=>'Маленький запас вариации товара.','Limit result set to resources assigned to a specific parent. Applies to hierarchical taxonomies only.'=>'Ограничьте набор результатов ресурсами, назначенными определённому родителю. Применяется только к иерархической таксономии.','Offset the result set by a specific number of items. Applies to hierarchical taxonomies only.'=>'Смещение набора результатов на определенное количество элементов. Применяется только к иерархической таксономии.','Low Stock amount for the product.'=>'Маленький запас товара.','Coupon item ID is readonly.'=>'ID купона доступен только для чтения.','Search for a page&hellip;'=>'Искать страницу&hellip;','Additional tax class "%1$s" couldn\'t be saved. %2$s.'=>'Не удалось сохранить дополнительный налоговый класс «%1$s». %2$s.','Start selling'=>'Начать продавать','You\'re almost there! Once you complete store setup you can start receiving orders.'=>'Вы почти там! После завершения настройки магазина вы сможете начать получать заказы.','of'=>'из','Step'=>'Шаг','WooCommerce Setup'=>'Настройка WooCommerce','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'Когда запас вариации товара достигнет этого количества, вы получите уведомление по электронной почте. Стандартное значение для всех вариаций можно установить на вкладке запасов товара. Значение магазина по умолчанию можно установить в разделе Настройки > Товары > Запасы.','Parent product\'s thr