ackage.'=>'Название пакета.','The ID of the package the shipping rates belong to.'=>'ID пакета, к которому относятся тарифы доставки.','List of cart item errors, for example, items in the cart which are out of stock.'=>'Список ошибок товаров в корзине, например, тех, что нет в наличии.','The amount of tax charged.'=>'Сумма налога.','The name of the tax.'=>'Название налога.','Lines of taxes applied to items and shipping.'=>'Действие налогов распространяется на товары и доставку.','Total tax applied to items and shipping.'=>'Итоговая сумма налогов на товары и доставку.','Total price the customer will pay.'=>'Итоговая сумма, которую заплатит клиент.','Total price of shipping.'=>'Общая стоимость доставки.','Total tax removed due to discount from applied coupons.'=>'Итоговая сумма снижения налога после применения скидок купонов.','Total discount from applied coupons.'=>'Итоговая сумма скидок применённых купонов.','Total tax on fees.'=>'Итоговая сумма налогов на комиссии.','Total price of any applied fees.'=>'Итоговая сумма действующих комиссий.','Total tax on items in the cart.'=>'Итоговая сумма налога на товары в корзине.','Total price of items in the cart.'=>'Итоговая стоимость товаров в корзине.','Cart total amounts provided using the smallest unit of the currency.'=>'Итоговая сумма корзины, указанная в самой мелкой денежной единице.','True if the cart needs payment. False for carts with only free products and no shipping costs.'=>'Верно, если необходимо оплатить корзину. Неверно для корзин, включающих только бесплатные товары без стоимости доставки.','Current set shipping address for the customer.'=>'Заданный адрес доставки клиента.','List of available shipping rates for the cart.'=>'Список доступных тарифов доставки для этой корзины.','List of applied cart coupons.'=>'Список примененных к корзине купонов.','Error message'=>'Сообщение об ошибке','Error code'=>'Код ошибки','Number of reviews for products in this category.'=>'Количество отзывов на товары в этой категории.','Category image.'=>'Изображение категории.','Returns number of products within attribute terms.'=>'Выдаёт количество товаров в пределах атрибутов.','Min and max prices found in collection of products, provided using the smallest unit of the currency.'=>'Минимальная и максимальная цены товаров, указанные в самых мелких денежных единицах.','%1$s requires an instance of %2$s or %3$s for the address'=>'%1$s требует экземпляр %2$s или %3$s для адреса','Country/Region code in ISO 3166-1 alpha-2 format.'=>'Код страны/региона в формате ISO 3166-1 alpha-2.','State/County code, or name of the state, county, province, or district.'=>'Код области/региона или название области, района или провинции.','Apartment, suite, etc.'=>'Крыло, этаж и т.д.','Price prefix for the currency which can be used to format returned prices.'=>'Префикс цены, который может использоваться для форматирования возвращаемых цен.','Thousand separator for the currency which can be used to format returned prices.'=>'Разделитель тысяч, который может использоваться для форматирования возвращаемых цен.','Decimal separator for the currency which can be used to format returned prices.'=>'Десятичный разделитель для валюты, которая будет использоваться для возвращаемых цен.','Currency minor unit (number of digits after the decimal separator) for returned prices.'=>'Дробная единица валюты (количество цифр после десятичного знака) для возвращаемых цен.','Currency symbol for the currency which can be used to format returned prices.'=>'Символ валюты, которая будет использоваться для возвращаемых цен.','Currency code (in ISO format) for returned prices.'=>'Код валюты (в формате  ISO) для возвращаемых цен.','Total tax removed due to discount applied by this coupon.'=>'Итоговая сумма снижения налога после применения скидки купона.','Total discount applied by this coupon.'=>'Итоговая сумма скидки купона.','Total amounts provided using the smallest unit of the currency.'=>'Итоговая сумма, указанная в самой мелкой денежной единице.','The coupons unique code.'=>'Уникальный код купонов.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'URL для переадресации клиентов после оформления заказа. Например, это может быть ссылка на веб-сайт платёжной системы.','An array of data being returned from the payment gateway.'=>'Массив данных, возвращаемый из платежного шлюза.','Status of the payment returned by the gateway. One of success, pending, failure, error.'=>'Статус платежа, возвращаемого шлюзом. Один из вариантов: успешно, в ожидании, сбой, ошибка.','Result of payment processing, or false if not yet processed.'=>'Результат обработки платежа, или ложный результат, если обработка не завершена.','The ID of the payment method being used to process the payment.'=>'ID способа оплаты, используемого для обработки платежа.','Customer ID if registered. Will return 0 for guests.'=>'ID клиента, если он зарегистрирован. Будет равен 0 для гостей.','Note added to the order by the customer during checkout.'=>'Примечание, добавленное клиентом к заказу в процессе его оформления.','Order key used to check validity or protect access to certain order data.'=>'Ключ заказа, используемый для проверки точности или защиты доступа к некоторым данным заказ.','Order status. Payment providers will update this value after payment.'=>'Статус заказа. Платежный сервис обновит это значение после платежа.','The order ID to process during checkout.'=>'ID заказа для обработки во время оформления заказа.','Parent term ID, if applicable.'=>'ID родительского условия, если применимо.','Quantity left in stock if stock is low, or null if not applicable.'=>'Количество товара в наличии, если запас на исходе, или ноль, если неприменимо.','List of variation IDs, if applicable.'=>'Список ID вариации, если есть.','Price string formatted as HTML.'=>'Строка цены, форматированная в HTML.','Price data provided using the smallest unit of the currency.'=>'Информация о цене в самой мелкой единице валюты.','Product full description in HTML format.'=>'Полное описание товара в формате HTML.','Product short description in HTML format.'=>'Краткое описание товара в формате HTML.','ID of the parent product, if applicable.'=>'ID родительского товара, если есть.','&quot;%s&quot; is not available for purchase.'=>'«%s» невозможно оформить для покупки.','The "%1$s" coupon has been removed from your cart: %2$s'=>'Купон "%1$s" удален из вашей корзины: %2$s','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'«%s» уже применён и не может использоваться вместе с другими купонами.','Coupon code "%s" has already been applied.'=>'Код купона «%s» уже применён.','"%s" is an invalid coupon code.'=>'«%s» является недействительным кодом купона.','Cart item is invalid.'=>'В корзине находится недопустимый товар.','Invalid coupons were removed from the cart: "%s"'=>'Недействительные купоны удалены из корзины: «%s».','Cannot create order from empty cart.'=>'Невозможно создать заказ, когда корзина пуста.','The chosen rate ID for the package.'=>'ID выбранного для пакета тарифа.','Limit result set to reviews from specific product IDs.'=>'Ограничение результатов отзывами о товарах с конкретными ID.','Limit result set to reviews from specific category IDs.'=>'Ограничение результатов отзывами о товарах в конкретных категориях.','Method not implemented'=>'Метод не применён','New quantity of the item in the cart.'=>'Новое количество товаров в корзине.','Unique identifier (key) for the cart item to update.'=>'Уникальный идентификатор (ключ) для обновления товара в корзине.','The %s payment gateway is not available.'=>'Платежный шлюз %s недоступен.','No payment method provided.'=>'Способ платы не указан.','Invalid payment result received from payment method.'=>'От способа оплаты получен результат недопустимого платежа.','Data to pass through to the payment method when processing payment.'=>'Данные, необходимые службе оплаты для обработки платежа.','Cart item no longer exists or is invalid.'=>'Товара в корзине больше не существует или он недействительный.','Unique identifier (key) for the cart item.'=>'Уникальный идентификатор (ключ) товара в корзине.','If true, empty terms will not be returned.'=>'Если установлено значение true, пустые условия не будут возвращаться.','Sort by term property.'=>'Сортировать по свойству условия.','Sort ascending or descending.'=>'Сортировка по возрастанию или убыванию.','Coupon does not exist in the cart.'=>'В корзине нет купона.','Coupon cannot be removed because it is not already applied to the cart.'=>'Невозможно удалить купон, так как он уже применен к корзине.','Invalid coupon code.'=>'Неверный код купона.','Coupons are disabled.'=>'Купоны отключены.','Unique identifier for the coupon within the cart.'=>'Уникальный идентификатор купона в корзине.','ISO code for the country of the address being shipped to.'=>'Код ISO страны, в которую выполняется доставка.','Zip or Postcode of the address being shipped to.'=>'Почтовый индекс, соответствующий адресу доставки.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'Код ISO или название края, области, провинции или района, куда выполняется доставка.','City of the address being shipped to.'=>'Город, в который выполняется доставка.','Second line of the address being shipped to.'=>'Вторая строка адреса доставки.','First line of the address being shipped to.'=>'Первая строка адреса доставки.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Ограничить результаты товарами на основе максимальной цены, указанной с использованием самых мелких денежных единиц.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Ограничить результаты товарами на основе минимальной цены, указанной с использованием самых мелких денежных единиц.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Максимальное количество элементов, возвращаемых в результирующем наборе. При пустом поле ограничения отсутствуют.','Invalid category ID.'=>'Недопустимый ID категории.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Сбой создания таблицы %1$s WooCommerce. Есть ли у пользователя %2$s права на СОЗДАНИЕ в базе данных %3$s?','Verifying database... One or more tables are still missing: '=>'Проверка базы данных... Одна или несколько таблиц по-прежнему отсутствуют: ','Database verified successfully.'=>'База данных проверена.','You need WooCommerce 4.2 or newer to run this tool.'=>'Чтобы запустить этот инструмент, необходимо решение WooCommerce 4.2 или более новой версии.','The active version of WooCommerce does not support template cache clearing.'=>'Активная версия WooCommerce не поддерживает очистку кэша шаблона.','Template cache cleared.'=>'Кэш шаблона очищен.','Verify if all base database tables are present.'=>'Проверить наличие всех основных таблиц базы данных.','Verify database'=>'Проверить базу данных','Verify base database tables'=>'Проверить основные таблицы базы данных','This tool will empty the template cache.'=>'Этот инструмент позволяет очистить кэш шаблона.','Clear template cache'=>'Очистить кэш шаблона','Collect and validate EU VAT numbers at checkout'=>'Собирать и проверять номера плательщиков НДС (ЕС) при оформлении заказа','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Если ваш магазин находится на территории ЕС, рекомендуем помимо автоматических налогов использовать расширение "Номер плательщика НДС (ЕС)". Благодаря нему на странице оформления заказа появляется поле, которое позволяет собирать и проверять номер плательщика НДС в ЕС, если такой есть у клиента.','Get real-time order alerts anywhere'=>'Получайте уведомления о новых заказах в реальном времени, где бы вы ни находились','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Получайте уведомления об активности в магазине, в том числе о размещении новых заказов и отзывов о товарах, прямо на мобильные устройства благодаря приложению Woo.','First order received'=>'Получен первый заказ','Remove legacy coupon menu'=>'Удалить устаревшее меню купонов','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Теперь управление купонами производится в разделе Маркетинг > Купоны. Нажмите кнопку ниже, чтобы удалить устаревший элемент меню WooCommerce > Купоны.','Coupon management has moved!'=>'Управление купонами теперь в новом месте!','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Это обучающее видео поможет вам добавить в WooCommerce первый товар.','Do you need help with adding your first product?'=>'Нужна помощь с добавлением первого товара?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Запускать веб-сайт о моде интересно, но требует много сил. В этой статье мы поможем вам преодолеть процесс настройки шаг за шагом, научим создавать списки товаров и покажем, как привлечь нужных посетителей.','Start your online clothing store'=>'Запустите свой магазин одежды','The admin note layout has a wrong prop value.'=>'Макет примечания администратора включает неверное значение свойства.','Watch tutorial'=>'Смотреть видео','Share feedback'=>'Поделится отзывом','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Теперь, когда мы стали вашим партнером, мы постараемся обеспечить вас всеми необходимыми инструментами. Ждем ваш отзыв о процессе настройки магазина. Он поможет нам оптимизировать его в будущем.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Изменение платформы eCommerce может показаться непреодолимым препятствием, но на самом деле перенести товары, клиентов и заказы на WooCommerce не так уж сложно. Эта статья поможет вам все сделать правильно.','Do you want to migrate from Shopify to WooCommerce?'=>'Хотите перейти с Shopify на WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'Подписки WooCommerce позволяют предлагать различные подписки на физические и виртуальные товары и услуги. Создавайте клубы с ежемесячным получением набора товаров, недельные подписки на услуги или даже пакеты ПО с годовой подпиской. Добавляйте плату за регистрацию, предлагайте бесплатные пробные версии, или установите срок окончания действия программы.','Do you need more info about WooCommerce Subscriptions?'=>'Нужно больше информации о подписках WooCommerce?','There was a problem activating some of the requested plugins.'=>'При активации некоторых требуемых плагинов возникла проблема.','Plugins were successfully activated.'=>'Плагины активированы.','The requested plugin `%s`. is not yet installed.'=>'Требуемый плагин «%s» ещё не установлен.','There was a problem installing some of the requested plugins.'=>'При установке некоторых требуемых плагинов во