ing new features that are being progressively rolled out to improve the store management experience.'=>'Начните использовать новые возможности, которые будут разворачиваться постепенно. С ними управлять магазином станет удобнее.','Features'=>'Возможности','One or more tables required for WooCommerce to function are missing, some features may not work as expected. Missing tables: %1$s.'=>'Отсутствует одна или несколько страниц, требуемых для работы WooCommerce. Некоторые функции могут работать некорректно. Отсутствующие таблицы: %1$s.','One or more tables required for WooCommerce to function are missing, some features may not work as expected. Missing tables: %1$s. <a href="%2$s">Check again.</a>'=>'Отсутствует одна или несколько страниц, требуемых для работы WooCommerce. Некоторые функции могут работать некорректно. Отсутствующие таблицы %1$s. <a href="%2$s">Проверить снова</a>','Database tables missing'=>'Отсутствуют таблицы базы данных','Missing base tables: %s. Some WooCommerce functionality may not work as expected.'=>'Отсутствующие основные таблицы: %s. Некоторые функции WooCommerce могут работать некорректно.','Home'=>'Обзор','Utilities'=>'Служебные программы','Import / Export'=>'Импорт/экспорт','Marketplace'=>'Каталог','Overview'=>'Обзор','Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.'=>'Принимайте платежи в удобной для вас системе — вам доступны более 100 платежных шлюзов для WooCommerce.','Start accepting payments on your store!'=>'Начните принимать платежи в своем магазине!','Install plugins'=>'Установить плагины','Uh oh... There was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again.'=>'Ой... Во время установки плагинов Jetpack и WooCommerce Shipping & Tax возникла проблема. Повторите попытку.','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Мы заметили, что во время установки плагинов Jetpack и WooCommerce Shipping & Tax возникла проблема. Повторите попытку и воспользуйтесь всеми преимуществами подключаемых плагинов для магазина! Извините за неудобства. Эти плагины будут установлены и активированы бесплатно.','User&#8217;s WooCommerce payment tokens data.'=>'Данные о токенах платежей пользователя WooCommerce.','User&#8217;s WooCommerce access to purchased downloads data.'=>'Доступ пользователя WooCommerce к данным об оплаченных загрузках.','User&#8217;s WooCommerce purchased downloads data.'=>'Данные об оплаченных загрузках пользователя WooCommerce.','User&#8217;s WooCommerce orders data.'=>'Данные о заказах пользователя WooCommerce.','User&#8217;s WooCommerce customer data.'=>'Клиентские данные пользователя WooCommerce.','Zambézia'=>'Замбезия','Tete'=>'Тете','Sofala'=>'Софала','Niassa'=>'Ниасса','Nampula'=>'Нампула','Maputo'=>'Мапуту','Maputo Province'=>'Мапуту, провинция','Manica'=>'Маника','Inhambane'=>'Иньямбане','Gaza'=>'Газа','Cabo Delgado'=>'Кабу-Делгаду','Western North'=>'Северо-западная область','Volta'=>'Вольта','Upper West'=>'Верхняя Западная область','Upper East'=>'Верхняя Восточная область','Savannah'=>'Саванна','Oti'=>'Оти','North East'=>'Северо-восточная область','Greater Accra'=>'Большая Аккра','Bono East'=>'Боно-Ист','Bono'=>'Боно','Brong-Ahafo'=>'Бронг-Ахафо','Ashanti'=>'Ашанти','Ahafo'=>'Ахафо','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'Каталог загрузок магазина <a href="%1$s">открыт для просмотра в Интернете</a>. Мы настоятельно рекомендуем <a href="%2$s">настроить на веб-сервере блокировку индексации каталога</a>.','%s() was called before the Action Scheduler data store was initialized'=>'%s() был вызван перед тем, как было инициализировано хранилище данных Action Scheduler','Finish setup'=>'Завершить настройку','Take payments via bank transfer.'=>'Принимайте оплату банковским переводом.','Take payments in cash upon delivery.'=>'Принимайте оплату наличными при доставке.','Payfast'=>'Payfast','If checked, free shipping would be available based on pre-discount order amount.'=>'Если галочка установлена, может быть доступна бесплатная доставка при определенной сумме заказа без учета скидки.','Apply minimum order rule before coupon discount'=>'Применить правило минимальной суммы заказа без учета скидки','Coupons discounts'=>'Скидки купонов','Please visit the <a href="%s" target="_blank">subscriptions page</a> and renew to continue receiving updates.'=>'Посетите <a href="%s" target="_blank">страницу подписок</a> и продлите свою подписку, чтобы получать обновления.','WooCommerce.com support'=>'Поддержка WooCommerce.com','For further assistance with WooCommerce core, use the <a href="%1$s">community forum</a>. For help with premium extensions sold on WooCommerce.com, <a href="%2$s">open a support request at WooCommerce.com</a>.'=>'Дополнительную помощь по использованию основных возможностей WooCommerce можно получить на <a href="%1$s">форуме сообщества</a>. Если вам нужна помощь по работе с премиум-расширениями WooCommerce.com, <a href="%2$s">отправьте запрос в службу поддержки на WooCommerce.com</a>.','Installed version not tested with active version of WooCommerce %s'=>'Установленная версия не тестировалась с действующей версией WooCommerce %s','%1$s (update to version %2$s is available)'=>'%1$s (доступно обновление до версии %2$s)','Visit WooCommerce.com to learn more about <a href="%1$s" target="_blank">getting started</a>.'=>'Посетите WooCommerce.com, чтобы узнать о том, <a href="%1$s" target="_blank">с чего начать работу</a>.','The plugin could not be activated.'=>'Не удалось активировать плагин.','Limit stats fields to the specified items.'=>'Ограничьте поля статистики определёнными товарами.','Name of other platform used to sell (not listed).'=>'Название платформы, используемой для продажи (нет в списке).','There was an error communicating with the WooPayments plugin.'=>'Произошла ошибка при обмене данными с плагином WooPayments.','Shipping Label'=>'Транспортная этикетка','Personalize homepage'=>'Настройте главную страницу','Personalize your store\'s homepage'=>'Настройте главную страницу магазина','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Страница обзора — один из самых важных разделов вашего магазина. Правильная настройка может помочь повысить конверсию и интерес посетителей. Не забывайте о возможности редактировать страницу, которую мы создали для вашего магазина в процессе адаптации.','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.'=>'Безопасно принимайте кредитные и дебетовые карты на своем сайте. Управляйте транзакциями, не выходя из панели управления WordPress. Только с <strong>WooPayments</strong>.','Try the new way to get paid'=>'Попробуйте новый способ приёма платежей','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Кажется, отсутствует одна или несколько таблиц баз данных. Пытаемся восстановить отсутствующие таблицы.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Ваш магазин настроен для размещения цифровых товаров методом «только переадресация». Этот метод устарел, <a href="%s">вам необходимо переключиться на другой метод</a>.<br><em>Если вы используете отдалённый сервер для загрузки файлов (например, Google Диск, Dropbox, Amazon S3), при желании вы можете «разрешить использование переадресации в крайнем случае». При включении этого параметра и/или выборе любого другого параметра это уведомление исчезнет.</em>','Choose theme'=>'Выбор темы','Get started'=>'Приступить','Mobile app'=>'Мобильное приложение','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Mailchimp позволяет рассылать нацеленные кампании, восстанавливать оставленные корзины покупок и многое другое.','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.'=>'Безопасно принимайте кредитные и дебетовые карты с единой низкой ставкой, без неожиданных комиссионных сборов (доступны настраиваемые ставки). Продавайте онлайн и в магазине. Отслеживайте продажи и складские запасы в одной точке.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries.'=>'Выберите необходимый платёж. Оплатите сразу, позже или по частям. Ни номеров кредитных карт, ни паролей, ни других проблем.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.'=>'Принимайте дебетовые и кредитные карты, поддерживая свыше 135 иностранных валют и разные методы оплаты, например Alipay, и оформляйте заказ одним касанием с помощью Apple Pay.','Store connected successfully.'=>'Магазин успешно подключен.','Purchase & install now'=>'Купить и установить сейчас','Average order value'=>'Средняя стоимость заказа','Gross sales'=>'Валовый доход','Customer type'=>'Тип клиента','Edit Product'=>'Изменить товар','Edit Coupon'=>'Изменить купон','Edit Order'=>'Изменить заказ','