ate.'=>'Очередной этап заказа. Посмотрите на отчёт о заказах, в котором собраны все ваши заказы за день.','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Вы достигли уровня в 10 заказов! Посмотрите на свой прогресс. Для мотивации просмотрите некоторые истории успеха пользователей WooCommerce.','Congratulations on getting your first order! Now is a great time to learn how to manage your orders.'=>'Поздравляем с получением первого заказа! Самое время узнать, как управлять этими заказами.','Congratulations on processing %s orders!'=>'Поздравляем с обработкой %s заказов!','Review'=>'Отзыв','Activate usage tracking'=>'Активировать отслеживание использования','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the %1$sSettings%3$s and choose to stop sharing data. %2$sRead more%3$s about what data we collect.'=>'Сбор данных об использовании позволяет нам улучшить WooCommerce. Информация о вашем магазине будет использоваться для оценки новых функций, определения качества обновлений и принятия решений о целесообразности дальнейших улучшений. Вы всегда можете зайти в %1$sНастройки%3$s и выбрать отмену отправки ваших данных. %2$sЧитать подробнее%3$s о том, какие данные мы собираем.','The admin note action label prop cannot be empty.'=>'Метка действия заметки администратора не может быть пустой.','The admin note action name prop cannot be empty.'=>'Название действия заметки администратора не может быть пустым.','The admin note date prop cannot be empty.'=>'Дата заметки администратора не могут быть пустой.','The admin note source prop cannot be empty.'=>'Источник заметки администратора не может быть пустым.','The admin note status prop (%s) is not one of the supported statuses.'=>'Состояние заметки администратора (%s) не является одним из поддерживаемых сос