at should not be included when calculating report totals.'=>'Состояния, которые не должны учитываться при расчете итогов отчёта.','Excluded report order statuses'=>'Исключённые статусы заказа отчёта','Settings for WooCommerce admin reporting.'=>'Настройки для отчетов администратора WooCommerce.','%1$s &lsaquo; %2$s'=>'%1$s &lsaquo; %2$s','Stopped the insanity for %d second'=>'Ограничение на %d секунду' . "\0" . 'Ограничение на %d секунды' . "\0" . 'Ограничение на %d секунд','The next queue will begin processing in approximately %d seconds.'=>'Обработка следующей очереди начнется примерно через %d сек.','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'Началась обработка новой очереди. <a href="%s">Посмотреть выполняемые действия &raquo;</a>','Unknown status found for action.'=>'Найден неизвестный статус для действия.','Invalid value for select or count parameter. Cannot query actions.'=>'Неверное значение для параметра select или count. Невозможно запросить действия.','Database error.'=>'Ошибка базы данных.','%s Support for strings longer than this will be removed in a future version.'=>'%s Поддержка более длинных строк будет удалена в следующей версии.','ActionScheduler_Action::$args too long. To ensure the args column can be indexed, action args should not be more than %d characters when encoded as JSON.'=>'ActionScheduler_Action::$args имееи слишком большую длину. Для индексации столбца args аргументы действия не должны содержать символов более %d при кодировании в формате JSON.','There was a failure scheduling the next instance of this action: %s'=>'Произошла ошибка при планировании следующего экземпляра этого действия: %s','There was a failure fetching this action: %s'=>'Не удалось получить это действие %s','action ignored via %s'=>'действие игнорируется через %s','action failed via %1$s: %2$s'=>'действие не удалось через %1$s: %2$s','action complete via %s'=>'действие завершено через %s','action started via %s'=>'действие 