ла','Redirect only (Insecure)'=>'Только редирект (небезопасно)','If you are using X-Accel-Redirect download method along with NGINX server, make sure that you have applied settings as described in <a href=\'%s\'>Digital/Downloadable Product Handling</a> guide.'=>'Если используется метод загрузки X-Accel-Redirect вместе с NGINX, настройки должны соответствовать рекомендациям этого <a href=\'%s\' target="_blank" title="Digital/Downloadable Product Handling">руководства</a>.','Choose countries / regions&hellip;'=>'Выберите страны/регионы&hellip;','Choose a country / region&hellip;'=>'Выберите страну/регион&hellip;','Fees:'=>'Комиссии:','Coupon(s):'=>'Купоны:','Items Subtotal:'=>'Подытог по товарам:','Country / Region'=>'Страна/регион','WooCommerce database update done'=>'Обновление базы данных WooCommerce завершено','WooCommerce database update in progress'=>'Идёт обновление базы данных WooCommerce','View progress →'=>'Просмотр прогресса→','Shipping Country / Region'=>'Страна/регион доставки','Billing Country / Region'=>'Страна/регион выставления счёта','Select a country / region&hellip;'=>'Выберите страну/регион&hellip;','Product on sale'=>'Продаваемый товар','List of categories with their product counts'=>'Список категорий с указанием количества товаров','List of categories'=>'Список категорий','You are paying for a guest order. Please continue with payment only if you recognize this order.'=>'Вы платите за заказ гостя. Продолжайте оплату, только если вы знаете про этот заказ.','block descriptionDisplay a call to action button which either adds the product to the cart, or links to the product page.'=>'Отображение кнопки добавления товара в корзину либо переадресации на его страницу.','Clear All'=>'Очистить все','Up to %s'=>'До %s','From %s'=>'От %s','Filter by attribute'=>'Фильтрация по атрибутам','Thumbnail sizes for responsive images.'=>'Миниатюры адаптивных изображений.','Thumbnail srcset for responsive images.'=>'Атрибут srcset миниатюр адаптивных изображений.',