ion.'=>'Описание элемента.','String based identifier for the term.'=>'Строковый идентификатор элемента.','Limit result set to products with a certain average rating.'=>'Показать в результатах поиска товары с определенным средним рейтингом.','The logical relationship between attributes when filtering across multiple at once.'=>'Логическая связь между атрибутами при одновременной фильтрации по нескольким.','List of attribute slug(s). If a term ID is provided, this will be ignored.'=>'Список ярлыков атрибутов. Если указан ID значения, данная опция будет проигнорирована.','List of attribute term IDs.'=>'Список ID значений атрибутов.','Attribute taxonomy name.'=>'Название таксономии атрибута.','Limit result set to products with selected global attributes.'=>'Ограничить список товарами с выбранными глобальными атрибутами.','When limiting response using after/before, which date column to compare against.'=>'При ограничении ответа с помощью параметра до/после укажите, с каким столбцом даты сравнивать.','Limit response to resources created before a given ISO8601 compliant date.'=>'Ограничить ответ для ресурсов, опубликованных до указанной даты в совместимом с ISO 8601 формате.','If true, calculates rating counts for products in the collection.'=>'Подсчитывает оценки товаров в коллекции.','Filter condition	 being performed which may affect counts. Valid values include "and" and "or".'=>'Состояние фильтра	 выполняется, что может повлиять на подсчёт. Допустимые значения включают «и» и «или».','Taxonomy name.'=>'Название таксономии.','If requested, calculates attribute term counts for products in the collection.'=>'По запросу вычисляет количество значений атрибутов товаров в коллекции.','If true, calculates the minimum and maximum product prices for the collection.'=>'Если установлено значение ИСТИНА, возвращает минимальные и максимальные цены товаров в коллекции.','Returns number of products with each average rating.'=>'Выдаёт товары со средним рейтингом каждого.','Number of products.'=>'Число товаров.','Max price found in collection of products.'=>'Максимальная цена, найденная в коллекции товаров.','Min price found in collection of products.'=>'Минимальная цена, найденная в коллекции товаров.','Invalid attribute ID.'=>'Неверный ID атрибута.','Cannot create an existing cart item.'=>'Нельзя создать позицию, которая уже в корзине.','Cart item does not exist.'=>'Такой позиции не существует.','Unique identifier for the item within the cart.'=>'Уникальный идентификатор позиции в корзине.','Unable to retrieve cart.'=>'Не удалось загрузить данные о корзине.','Attribute does not exist.'=>'Такого атрибута не существует.','Unique identifier for the attribute.'=>'Уникальный идентификатор атрибута.','No matching variation found.'=>'Подходящих вариаций не найдено.','Missing variation data for variable product.'=>'Отсутствуют данные вариации вариативного товара.','Invalid value posted for %1$s. Allowed values: %2$s'=>'Установлено неверное значение для %1$s. Допустимые значения: %2$s','This product cannot be added to the cart.'=>'Этот товар нельзя добавить в корзину.','Total post count.'=>'Общее число записей.','Xaisomboun'=>'Сайсомбун','Xiangkhouang'=>'Сиангкхуанг','Sekong'=>'Секонг','Sainyabuli'=>'Сайнябули','Vientiane'=>'Вьентьян','Vientiane Province'=>'Вьентьян, провинция','Savannakhet'=>'Саваннакхет','Salavan'=>'Салаван','Phongsaly'=>'Пхонгсали','Oudomxay'=>'Удомсай','Luang Prabang'=>'Луангпхабанг','Luang Namtha'=>'Луангнамтха','Khammouane'=>'Кхаммуан','Houaphanh'=>'Хуапхан','Champasak'=>'Тямпасак','Bolikhamsai'=>'Боликхамсай','Bokeo'=>'Бокэу','Attapeu'=>'Аттапы','checkout-validationBilling %s'=>'Платежи %s','checkout-validationShipping %s'=>'Доставка %s','Thank you for your payment. Your transaction has been completed, and a receipt for your purchase has been emailed to you. Log into your PayPal account to view transaction details.'=>'Благодарим за оплату. Платеж успешно обработан. Квитанция об оплате отправлена на ваш Email. Войдите в учетную з