ce обновляет данные о товарах в фоновом режиме','WooCommerce is updating the database in the background. The database update process may take a little while, so please be patient.'=>'WooCommerce обновляет базу данных в фоновом режиме. Процесс обновления базы данных может занять некоторое время, пожалуйста, подождите.','Is your site connected to WooCommerce.com?'=>'Ваш сайт подключен к WooCommerce.com?','Must Use Plugins'=>'Обязательные плагины','Dropin Plugins'=>'Плагины "вкраплений"','Inactive plugins'=>'Неактивные плагины','Site address (URL)'=>'Адрес сайта (URL)','WordPress address (URL)'=>'Адрес WordPress (URL)','five star'=>'пять звезд','Start Import'=>'Начать импорт','Create Product'=>'Создать товар','Dismiss this suggestion'=>'Закрыть','Enter a coupon code to apply. Discounts are applied to line totals, before taxes.'=>'Введите код купона, чтобы применить скидку. Скидки применяются к итоговым суммам по позициям до вычета налогов.','Adjusted stock: %s'=>'Изменено количество товара в наличии: %s','Adds an option to the orders screen for removing personal data in bulk. Note that removing personal data cannot be undone.'=>'Добавляет возможность полного удаления личных данных из заказов. Обратите внимание, удаление личных данных невозможно отменить.','Allow personal data to be removed in bulk from orders'=>'Разрешить полное удаление личных данных из заказов','Personal data removal'=>'Удаление личных данных','Remove access to downloads on request'=>'Запрет доступа к загрузкам по запросу','Remove personal data from orders on request'=>'Удаление личных данных из заказов по запросу','Display suggestions within WooCommerce'=>'Отображение рекомендаций в WooCommerce','Show Suggestions'=>'Показывать рекомендации','We show contextual suggestions for official extensions that may be helpful to your store.'=>'WooCommerce предлагает контекстные рекомендации официальных расширений, которые могут пригодиться в вашем магазине.','Marketplace suggestions'=>'Рекомендуемое в каталоге