r for displayed prices in this country.'=>'Разделитель тысяч для отображаемых цен в этой стране.','Full name of state.'=>'Полное название области.','List of states in this country.'=>'Список штатов в этой стране.','Number of decimal points shown in displayed prices for this country.'=>'Число десятичных точек, показанных в отображаемых ценах для этой страны.','Full name of country.'=>'Полное название страны.','The unit lengths are defined in for this country.'=>'Единичные длины определены для этой страны.','Decimal separator for displayed prices for this country.'=>'Разделитель десятичной части для отображаемых цен для этой страны.','Currency symbol position for this country.'=>'Позиция символа валюты для этой страны.','Default ISO4127 alpha-3 currency code for the country.'=>'3-буквенный код валюты по ISO4127 по умолчанию для страны.','ISO3166 alpha-2 country code.'=>'2-буквенный код страны по ISO3166.','List of countries on this continent.'=>'Список стран на этом континенте.','Full name of continent.'=>'Полное название континента.','There are no locations matching these parameters.'=>'Нет местоположений, соответствующих этим параметрам.','2 character continent code.'=>'2-символьный код континента.','View affected templates'=>'Просмотреть шаблоны, на которые повлияет это действие','If you copied over a template file to change something, then you will need to copy the new version of the template and apply your changes again.'=>'Если вы скопировали файл-шаблон, чтобы что-то изменить, вам будет нужно скопировать новую версию шаблона и снова применить изменения.','Update your theme to the latest version. If no update is available contact your theme author asking about compatibility with the current WooCommerce version.'=>'Обновите свою тему до последней версии. Если обновление отсутствует, свяжитесь с автором темы и спросите о совместимости с текущей версией WooCommerce.','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>В вашей теме (%s) содержатся устаревшие копии нескольких шаблонов WooCommerce.</strong> Возможно, эти шаблоны потребуется обновить, чтобы обеспечить совместимость с текущей версией WooCommerce. Предлагаем выполнить следующее:','Export all categories'=>'Экспортировать все категории','Which product category should be exported?'=>'Какую категорию товаров нужно экспортировать?','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Это ID вложения или URL изображения, используемый для заполнителей в каталоге продукции. Они будут использоваться для товаров без изображения.','Enter attachment ID or URL to an image'=>'Введите ID вложения или URL-адрес изображения','Placeholder image'=>'Изображение-заполнитель','The "%s" payment method is currently disabled'=>'Способ оплаты «%s» в настоящее время отключён','The "%s" payment method is currently enabled'=>'Способ оплаты «%s» в настоящее время включён','Set up the "%s" payment method'=>'Установите способ оплаты «%s»','Manage the "%s" payment method'=>'Управляйте способом оплаты «%s»','Move down'=>'Сдвиг вниз','Move the "%s" payment method down'=>'Переместите способ оплаты «%s» вниз','Move up'=>'Сдвиг вверх','Move the "%s" payment method up'=>'Переместите способ оплаты «%s» вверх','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'При обработке %s, должен ли доступ к скачиваемым файлам быть закрыт, а журналы скачивания очищены?','When handling an %s, should personal data within orders be retained or removed?'=>'При обработке %s, должны ли персональные данные по заказам быть сохранены или удалены?','Enter a number to set stock quantity at the variation level. Use a variation\'s \'Manage stock?\' check box above to enable/disable stock management at the variation level.'=>'Введите число, чтобы установить количество запасов на уровне вариации. Используйте опцию «Управление запасами», расположенную выше, чтобы включать/выключать контроль количества товара на складе на уровне вариации.','Low stock amount'=>'Величина малых запасов','Set up PayPal for me using this email:'=>'Установите PayPal для меня, используя этот адрес электронной почты:','WooCommerce PayPal Checkout Gateway'=>'Шлюз оформления заказа WooCommerce PayPal','Set up Stripe for me using this email:'=>'Установите Stripe для меня, используя этот адрес электронной почты:','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Использовать %1$s для массы товара и %2$s для габаритов.','ShipStation'=>'ShipStation','ShipStation icon'=>'Значок ShipStation','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Для экономии времени в процессе оформления посылок в почтовом отделении, рекомендуем напечатать транспортные этикетки дома, с помощью ShipStation. Используйте ShipStation бесплатно в течение 30 дней.','WooCommerce Services icon'=>'Значок WooCommerce Services','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'Текущий тариф – это точная стоимость доставки заказа, которую предлагает непосредственно транспортная компания.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Если вы хотите предложить <span class="help_tip" data-tip="%1$s">текущие тарифы</span> от конкретной транспортной компании (например, UPS), доступные расширения для WooCommerce см. <a href="%2$s" target="_blank">здесь</a>.','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Мы создали две зоны доставки - только %s и остальная часть мира. Ниже вы можете указать стоимость доставки по единой ставке для этих зон или предложить бесплатную доставку.','Yards'=>'Ярды','Inches'=>'Дюймы','Millimeters'=>'Миллиметры','Centimeters'=>'Сантиметры','Meters'=>'Метры','Ounces'=>'Унции','Pounds'=>'Фунты','Grams'=>'Граммы','Kilograms'=>'Килограммы','Item moved down'=>'Элемент перемещён вниз','Item moved up'=>'Элемент перемещён вверх','You may need to manually restore the item\'s stock.'=>'Вам может потребоваться вручную восстановить количество по этой позиции на складе.','Are you sure you want to remove the selected items?'=>'Вы уверены, что хотите удалить выбранные пункты?','Alto Paraguay'=>'Альто-Парагвай','Presidente Hayes'=>'Пресиденте-Аес','Amambay'=>'Амамбай','Central'=>'Сентраль','Cordillera'=>'Кордильеры','San Pedro'=>'Сан-Педро','Sud Sardegna'=>'Южная Сардиния','Apartment, suite, unit, etc.'=>'Крыло, подъезд, этаж и т.д.','%d API key permanently revoked.'=>'%d ключ API отозван без возможности восстановления.' . "\0" . '%d ключа API отозваны без возможности восстановления.' . "\0" . '%d ключей API отозваны без возможности восстановления.','Cannot set attributes due to invalid parent product.'=>'Нельзя установить атрибуты из-за неверного родительского товара.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Это действие не может быть отменено. Вы уверены, что хотите удалить персональные данные из выбранных заказов?','shipping packagesShipping %d'=>'Доставка %d','Payer PayPal address'=>'Адрес PayPal плательщика','Payer last name'=>'Фамилия плательщика','Payer first name'=>'Имя плательщика','Shipping Address'=>'Адрес доставки','Billing Address'=>'Платёжный адрес','Shipping Address 1'=>'Адрес доставки 1','Billing Address 1'=>'Платёжный адрес 1','MySQL version string.'=>'Строка версии MySQL.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Ваш CSV должен включать столбцы в определенном порядке. %1$sНажмите для загрузки примера%2$s.','This will be how your name will be displayed in the account section and in reviews'=>'Так ваше имя будет отображаться в разделе аккаунта и при публикации отзывов','If you have a coupon code, please apply it below.'=>'Если у вас есть код купона, укажите его ниже.','terms and conditions'=>'правила и условия','privacy policy'=>'политика конфиденциальности','United States (US) dollar'=>'Доллар США','eCheck ending in %1$s'=>'eCheck заканчивается на %1$s','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal позволяет нам отправить один адрес Если вы используете PayPal для транспортной маркировки, возможно, предпочтительнее будет отправить адрес доставки, а не выставления счёта. При отключении этой опции Программа защиты продавцов PayPal может быть неприменима.','Log PayPal events, such as IPN requests, inside %s Note: this may log personal information. We recommend using this for debugging purposes only and deleting the logs when finished.'=>'Создание журналов событий PayPal, таких как запросы мгновенных платежных уведомлений (IPN), в %s Примечание: при этом в журнал может быть внесена конфиденциальная информация. Рекомендуется использовать эту функцию только в целях отладки и по её завершении удалять файлы журналов.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard перенаправляет клиентов на PayPal для ввода платёжных реквизитов.','Other locations'=>'Другие местоположения','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Любой способ «%1$s»','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Принимать платежи лично посредством чеков. Данный автономный шлюз можно использовать для тестовых покупок.','Account details:'=>'Данные аккаунта:','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Принимать платежи лично посредством прямого банковского перевода (BACS).','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'а,бы,быть,в,вам,вас,во,вы,до,его,её,же,за,и,из,или,к,как,ко,меня,моё,мой,мы,на,нам,наш,не,но,о,об,он,она,от,по,при,с,так,ты,у,уже,что,чтобы,это,я','Optionally add some text for the terms checkbox that customers must accept.'=>'При необходимости добавьте текст, который клиенты должны принять, поставив галочку.','%s page'=>'Стр. %s','No page set'=>'Страница не указана','Highlight required fields with an asterisk'=>'Выделить обязательные поля звёздочкой','I have read and agree to the website %s'=>'Я прочитал(а) и принимаю %s сайта','Required'=>'Обязательно','%s field'=>'%s поле','These options let you change the appearance of the WooCommerce checkout.'=>'Эти функции позволяют изменить внешний вид страницы оформления заказа WooCommerce.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Дополнительная информация в <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">Политике конфиденциальности PayPal</a>.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Мы принимаем платежи через PayPal. При обработке платежа некоторые ваши данные передаются в PayPal. К ним относится информация, необходимая для обработки или выполнения платежа, например сведения об общей стоимости покупки и платёжные реквизиты.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'В этом разделе вам необходимо указать, услугами каких сторонних платёжных сервисов вы пользуетесь для приёма платежей в своем магазине, так как эти сервисы могут обрабатывать данные покупателей. Мы привели сведения об использовании PayPal в качестве примера. Если вы не пользуетесь услугами PayPal, этот текст необходимо удалить.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Мы делимся информацией с третьими лицами, которые помогают нам предоставлять вам наши заказы и услуги магазина; например -','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'В этом разделе необходимо перечислить третьи стороны, которым вы передаёте информацию, указав, с какой целью вы это делаете. К таким целям может относиться, например, анализ данных, маркетинг, обеспечение работы платёжных шлюзов и встроенных объектов сторонних разработчиков.','What we share with others'=>'Какие данные мы передаём третьим сторонам','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Нашей команде необходим доступ к этой информации, чтобы выполнять ваши заказы и, при необходимости, возвращать средства и оказывать услуги поддержки.','Customer information like your name, email address, and billing and shipping information.'=>'Сведения о покупателе, к которым относятся ваше имя, адрес электронной почты, платёжные реквизиты и информация, связанная с доставкой.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Сведения о заказе: название купленного товара, время покупки и адрес доставки, а также','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Члены нашей команды имеют доступ к информации, которую вы нам предоставляете. Так, и администраторы, и менеджеры магазина имеют доступ к следующим данным:','Who on our team has access'=>'У каких членов команды магазина есть доступ','We will also store comments or reviews, if you choose to leave them.'=>'Также мы храним ваши комментарии и отзывы на товары.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Обычно мы храним данные о вас столько, сколько необходимо для целей, ради которых мы их собираем и используем. Исключение составляют случаи, когда мы обязаны продолжать хранить эту информацию в связи с требованиями законодательства. Так, информация о заказе хранится у нас на протяжении XX лет, согласно правилам налогообложения и бухгалтерского учёта. К этим сведениям относится ваше имя, адрес электронной почты, адрес выставления счёта и адрес доставки.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Когда вы создаёте аккаунт, мы сохраняем ваше имя, адрес, Email и телефон для автоматического заполнения формы при оформлении заказов в будущем.','Send you marketing messages, if you choose to receive them'=>'Отправлять маркетинговые сообщения, если вы решите их получать','Improve our store offerings'=>'Улучшите предложения нашего магазина','Comply with any legal obligations we have, such as calculating taxes'=>'Соблюдать любые наши юридические обязательства, например расчёт налогов','Set up your account for our store'=>'Создайте свою учётную запись в нашем магазине','Process payments and prevent fraud'=>'Обрабатывать платежи и предотвращать мошенничества','Respond to your requests, including refunds and complaints'=>'Отвечать на ваши запросы, включая возвраты и жалобы','Send you information about your account and order'=>'Отправлять вам информацию о вашей учётной записи и заказе','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Если вы захотите совершить у нас покупку, от вас потребуется предоставить сведения, включая ваше имя, адрес выставления счетов, адрес доставки, адрес электронной почты, номер телефона, данные банковской карты или платёжные реквизиты, а также дополнительные сведения аккаунта, такие как имя пользователя и пароль. Мы используем эти сведения в следующих целях:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Примечание: возможно, вам стоит подробно описать свою политику в отношении cookie и разместить здесь ссылку на неё.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Также мы используем cookie для отслеживания того, что вы кладёте в корзину, пока находитесь на нашем сайте.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Адрес доставки: он используется для оценки стоимость доставки до момента размещения заказа и отправки вам заказанных товаров!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Местоположение, IP и тип браузера: мы используем эти сведения для расчёта налогов и стоимости доставки','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Просмотренные вами товары: эти данные сохраняются, чтобы вы легко могли вернуться к товарам, которыми вы недавно интересовались','While you visit our site, we’ll track:'=>'Когда вы посещаете наш сайт, мы сохраняем следующие сведения о вас:','What we collect and store'=>'Какие данные мы собираем и храним','We collect information about you during the checkout process on our store.'=>'При оформлении заказа в нашем магазине мы собираем некоторые данные о вас.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Этот образец содержит основную информацию о том, какие персональные данные ваш магазин может собирать, хранить и передавать третьей стороне, а также о том, кто может получить доступ к этим данным. Информация относительно вашего магазина может отличаться в зависимости от вашего региона деятельности и используемых настроек и плагинов. Рекомендуем проконсультироваться с юристом о том, какие сведения следует раскрывать в вашей политике конфиденциальности.','Token'=>'Токен','Payment Tokens'=>'Платёжные токены','Access granted'=>'Доступ предоставлен','Download count'=>'Счетчик загрузок','User email'=>'Адрес электронной почты пользователя','Browser User Agent'=>'Пользовательский агент браузера','Items Purchased'=>'Приобретённые товары','Order Number'=>'Номер заказа','Download ID'=>'ID загрузки','Access to Purchased Downloads'=>'Доступ к купленным загрузкам','Purchased Downloads'=>'Загруженные покупки','Customer Data'=>'Данные клиента','Removed payment token "%d"'=>'Платёжный токен "%d" удалён','Personal data removed.'=>'Личные данные удалены.','Customer download permissions have been retained.'=>'Разрешения пользователя на загрузку сохранены.','Removed access to downloadable files.'=>'Удалён доступ к скачиваемым файлам.','Personal data within order %s has been retained.'=>'Персональные данные в заказе %s сохранены.','Removed personal data from order %s.'=>'Персональные данные из заказа %s удалены.','Removed customer "%s"'=>'Удалённый клиент «%s»','Shipping State'=>'Штат доставки','Shipping Postal/Zip Code'=>'Почтовый индекс места доставки','Shipping City'=>'Город доставки','Shipping Company'=>'Компания доставки','Shipping Last Name'=>'Фамилия получателя','Shipping First Name'=>'Имя получателя','Phone Number'=>'Номер телефона','Billing State'=>'Область получателя счёта','Billing Postal/Zip Code'=>'Почтовый индекс получателя счёта','Billing City'=>'Город получателя счёта','Billing Company'=>'Компания получателя счёта','Billing Last Name'=>'Фамилия получателя счёта','Billing First Name'=>'Имя получателя счёта','Error during status transition.'=>'Ошибка при передаче статуса.','Update status event failed.'=>'Не удалось выполнить обновление статуса.','Payment complete event failed.'=>'Не удалось завершить оплату.','User roleShop manager'=>'Менеджер магазина','User roleCustomer'=>'Клиент','optional'=>'необязательно','Display name'=>'Отображаемое имя','Display name cannot be changed to email address due to privacy concern.'=>'Отображаемое имя нельзя заменить адресом электронной почты из соображений защиты конфиденциальной информации.','display name%1$s %2$s'=>'%1$s %2$s','Unable to create order.'=>'Не удалось создать заказ.','Please read and accept the terms and conditions to proceed with your order.'=>'Чтобы продолжить оформление заказа, прочитайте правила и условия и подтвердите своё согласие с ними.','Unserializing instances of this class is forbidden.'=>'Десериализация экземпляров этого класса запрещена.','Cloning is forbidden.'=>'Клонирование запрещено.','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s удалили из вашей корзины, поскольку данный товар был изменён. Вы можете снова добавить его в корзину <a href="%2$s">здесь</a>.','Deleted all active sessions, and %d saved carts.'=>'Удалены все активные сеансы и сохранённые корзины (%d).','%d permissions deleted'=>'Разрешения удалены в количестве %d шт.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Этот инструмент удаляет из базы данных всю информацию о сеансах пользователей, включая текущие и сохранённые корзины.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Этот инструмент удаляет разрешения, для которых истёк срок действия или не осталось доступных загрузок.','Clean up download permissions'=>'Удаление неактуальных разрешений на загрузку','Used-up download permissions'=>'Израсходованные разрешения на загрузку','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Фильтрация товаров с определённым атрибутом. Использовать имя таксономии или ярлык атрибута.','Parent product does not match current variation.'=>'Родительский товар не соответствует текущей вариации.','If the payment was refunded via the API.'=>'Если уплаченные средства были возмещены через API.','Order total formatted for locale'=>'Итоговая сумма заказа в локальном формате','Name of the customer for the order'=>'Имя клиента для данного заказа','URL to edit the order'=>'URL-адрес для изменения заказа','Blog id of the record on the multisite.'=>'Идентификатор блога записи на мультисайте.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Похоже, ваш магазин не использует защищённое соединение. Настоятельно рекомендуем настроить доступ ко всему вашему сайту через HTTPS-соединение, чтобы защитить данные клиентов. <a href="%s">Читайте об этом здесь.</a>','WooCommerce pages'=>'Страницы WooCommerce','WooCommerce database version'=>'Версия базы данных WooCommerce','Displays whether or not WordPress is using an external object cache.'=>'Показывает, использует ли WordPress внешнее кэширование объектов.','External object cache'=>'Внешний кэш объектов','WordPress cron'=>'WordPress cron','WordPress debug mode'=>'WordPress режим отладки','WordPress memory limit'=>'WordPress ограничение памяти','WordPress multisite'=>'WordPress режим сети','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Доступна более новая версия WordPress (%2$s)','WordPress version'=>'Версия WordPress','WooCommerce version'=>'Версия WooCommerce','Settings tab labelPayments'=>'Платежи','Enable coupons'=>'Использование купонов','Rates will be configurable and taxes will be calculated during checkout.'=>'Можно будет настроить ставки, и налоги будут рассчитываться в процессе оформления заказа.','Enable tax rates and calculations'=>'Включить налоговые ставки и расчёты','Manage'=>'Управление','Enable the legacy REST API'=>'Включить устаревший REST API','Account endpoints'=>'Эндпоинты аккаунта','Secure checkout'=>'Безопасное оформление заказа','Legacy API'=>'Устаревший API','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Хранить выполненные заказы в течение определённого времени, прежде чем имеющиеся в них персональные данные будут обезличены.','Retain completed orders'=>'Хранить выполненные заказы','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Отменённые заказы не оплачены и могут быть отменены владельцем магазина или покупателем. По завершении указанного периода времени они будут удалены в мусорку.','Retain cancelled orders'=>'Хранить отменённые заказы','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Неудавшиеся заказы не оплачены и могут быть брошены клиентами. По завершении указанного периода времени они будут удалены в мусорку.','Retain failed orders'=>'Хранить неудавшиеся заказы','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Ожидающие утверждения заказы не оплачены. Покупатель может отказаться от такого заказа. По завершении указанного периода времени они будут удалены в мусорку.','Retain pending orders '=>'Хранить ожидающие заказы ','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Неактивные аккаунты — это те, в которые пользователь не заходил или из которых не делал заказов в течение определённого времени. Они будут удалены. А их заказы будут преобразованы в гостевые.','Retain inactive accounts '=>'Сохранение неактивных аккаунтов ','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Укажите, как долго следует сохранять персональные данные, которые уже не требуется обрабатывать. Чтобы данные сохранялись в течение неопределённого времени, оставьте следующие поля пустыми.','Personal data retention'=>'Хранение персональных данных','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Ваши личные данные будут использоваться для обработки ваших заказов, упрощения вашей работы с сайтом и для других целей, описанных в нашей %s.','Optionally add some text about your store privacy policy to show during checkout.'=>'Вы можете добавить текст о политике конфиденциальности вашего магазина. Этот текст будет отображаться при оформлении заказа.','Checkout privacy policy'=>'Политика конфиденциальности при оформлении заказа','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Ваши личные данные будут использоваться для упрощения вашего дальнейшего взаимодействия с сайтом, управления доступом к вашему аккаунту и других целей, описанных в документе %s.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'При необходимости, добавьте текст политики конфиденциальности своего магазина. Этот текст будет отображаться в форме регистрации аккаунта.','Registration privacy policy'=>'Политика конфиденциальности при регистрации','privacy page'=>'страница о конфиденциальности','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'В этом разделе можно настроить отображение политики конфиденциальности вашего сайта. Уведомления о защите конфиденциальной информации, приведённые ниже, не будут отображаться, если %s не настроена.','Privacy policy'=>'Политика конфиденциальности','Removed personal data from %s order.'=>'Удалены персональные данные из %s заказа.' . "\0" . 'Удалены персональные данные из %s заказов.' . "\0" . 'Удалены персональные данные из %s заказов.','Account erasure requests'=>'Запросы на удаление учётной записи','Allow customers to create an account on the "My account" page'=>'Позволять клиенту создавать учётную запись на странице "Мой аккаунт"','Allow customers to create an account during checkout'=>'Позволять клиенту создавать учётную запись во время оформления заказа','Allow customers to log into an existing account during checkout'=>'Разрешить пользователям вход в существующий аккаунт при оформлении заказа','Allow customers to place orders without an account'=>'Допускать оформление заказов без создания учётной записи','Guest checkout'=>'Оформление заказов гостей','Accounts &amp; Privacy'=>'Аккаунты и приватность','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Список разрешённых адресов электронной почты для сверки с адресом электронной почты покупателя при оформлении заказа. Разделяйте адреса электронной почты запятыми. Также можно использовать маску (*) для сверки частей адресов. Так, запись "*@gmail.com" соответствует всем адресам gmail.','Allowed emails'=>'Допустимые Email\'ы','Filter by registered customer'=>'Фильтрация по зарегистрированным пользователям','Remove personal data'=>'Удалить личные данные','Use previous column mapping preferences?'=>'Использовать предыдущие настройки сопоставления столбцов?','View &amp; Customize'=>'Визуальная настройка','Review Settings'=>'Перейти к настройкам','Visit Dashboard'=>'Перейти в консоль','You can also:'=>'Вы также можете:','You\'re ready to add products to your store.'=>'Теперь вы можете добавить товары в свой магазин.','Create some products'=>'Создать товары','Continue with WooCommerce Services'=>'Продолжить работу с WooCommerce Services','Connect your store to activate WooCommerce Services'=>'Подключите свой магазин, чтобы активировать WooCommerce Services','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'Спасибо, что используете Jetpack! Ваш магазин почти готов: чтобы активировать службы, такие как %s, просто подключите свой магазин.','Mailchimp for WooCommerce'=>'Mailchimp for WooCommerce','Mailchimp icon'=>'Значок Mailchimp','Join the 16 million customers who use Mailchimp. Sync list and store data to send automated emails, and targeted campaigns.'=>'Начните использовать MailChimp вместе с 16 миллионами пользователей. Синхронизируйте списки и храните данные, чтобы автоматически отправлять электронные письма и проводить целевые кампании.','Mailchimp'=>'Mailchimp','automated taxes icon'=>'значок автоматического расчёта налогов','Save time and errors with automated tax calculation and collection at checkout. Powered by WooCommerce Services and Jetpack.'=>'Сократите временные затраты и количество ошибок — используйте инструмент для автоматического расчёта налогов и их начисления при оформлении заказа. На базе WooCommerce Services и Jetpack.','Storefront icon'=>'Значок Storefront','Design your store with deep WooCommerce integration. If toggled on, we’ll install <a href="https://woocommerce.com/storefront/" target="_blank" rel="noopener noreferrer">Storefront</a>, and your current theme <em>%s</em> will be deactivated.'=>'Создайте свой магазин с глубокой интеграцией WooCommerce. При включении мы установим <a href="https://woocommerce.com/storefront/" target="_blank" rel="noopener noreferrer">Storefront</a>, и ваша текущая тема <em>%s</em> будет отключена.','Enhance your store with these recommended free features.'=>'Усовершенствуйте свой магазин с помощью этих бесплатных функций.','Recommended for All WooCommerce Stores'=>'Рекомендовано для всех магазинов WooCommerce','The PayFast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs.'=>'Расширение PayFast для WooCommerce позволяет принимать платежи по банковской карте и путем безналичных переводов через один из самых популярных платёжных шлюзов в Южной Африке. Вам не потребуется платить за установку или ежемесячно оплачивать подписку.','WooCommerce PayFast Gateway'=>'WooCommerce PayFast Gateway','The eWAY extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Расширение eWAY для WooCommerce позволяет принимать платежи по банковской карте прямо в вашем магазине, без перенаправления клиентов на сторонний сайт для оплаты.','WooCommerce eWAY Gateway'=>'WooCommerce eWAY Gateway','WooCommerce Square'=>'WooCommerce Square','Klarna Payments for WooComme