y.'=>'Это категория по умолчанию, и её нельзя удалить. Она автоматически присваивается товарам без категории.','Make &#8220;%s&#8221; the default category'=>'Сделать &#8220;%s&#8221; категорией по умолчанию','Deleting a category does not delete the products in that category. Instead, products that were only assigned to the deleted category are set to the category %s.'=>'Удаление категории не удаляет товары в этой категории. Вместо этого товары, которые были только в одной удаляемой категории, переносятся в категорию %s.','%s quantity'=>'Количество товара %s','Pay for this order'=>'Оплатить этот заказ','Sandbox API signature'=>'Подпись API песочницы','Sandbox API password'=>'Пароль API песочницы','Sandbox API username'=>'Имя пользователя API песочницы','Live API signature'=>'Live API signature','Live API password'=>'Live API password','Live API username'=>'Live API username','Send notifications when an IPN is received from PayPal indicating refunds, chargebacks and cancellations.'=>'Отправлять уведомления при получении IPN из PayPal с указанием возмещаемых сумм, возвратных платежей и отмены.','Enable IPN email notifications'=>'Включить уведомления по электронной почте IPN','IPN email notifications'=>'Уведомления IPN по эл. почте','SANDBOX ENABLED. You can use sandbox testing accounts only. See the <a href="%s">PayPal Sandbox Testing Guide</a> for more details.'=>'ПЕСОЧНИЦА ВКЛЮЧЁНА. Можно использовать только аккаунты для тестирования. Дополнительную информацию смотрите в <a href="%s">руководстве по тестированию песочницы PayPal</a>.','Invalid webhook.'=>'Недействительный вебзацеп.','Invalid download log: not found.'=>'Неверный журнал загрузок: не найдено.','Invalid download log: no ID.'=>'Проблема в журнале загрузок: нет ID.','Unable to insert download log entry in database.'=>'Невозможно вставить запись журнала загрузок в базу данных.','Images will display using the aspect ratio in which they were uploaded'=>'Изображения будут показаны с исходными пропорциями','Uncropped'=>'Без обрезки','Images will be cropped to a custom aspect ratio'=>'Изображения будут обрезаны до указанных пропорций','Images will be cropped into a square'=>'Изображения будут обрезаны в виде квадрата','1:1'=>'1:1','Thumbnail cropping'=>'Обрезка миниатюры','Thumbnail width'=>'Ширина миниатюры','Image size used for the main image on single product pages. These images will remain uncropped.'=>'Размер основного изображения на страницах товаров. Эти изображения не будут обрезаны.','Main image width'=>'Ширина основного изображения','Product Images'=>'Изображения товаров','How many rows of products should be shown per page?'=>'Сколько строк товаров должно быть показано на странице?','Rows per page'=>'Строк на странице','How many products should be shown per row?'=>'Сколько товаров должно быть показано в строке?','Products per row'=>'Товаров в строке','How should products be sorted in the catalog by default?'=>'Как товары должны быть отсортированы в каталоге по умолчанию?','Choose what to display on product category pages.'=>'Выберите, что отображать на страницах категорий товаров.','Category display'=>'Отображение категории','Choose what to display on the main shop page.'=>'Выберите, что отображать на основной странице магазина.','Product Catalog'=>'Каталог товаров','Enable store notice'=>'Включить уведомление магазина','If enabled, this text will be shown site-wide. You can use it to show events or promotions to visitors!'=>'Если включено, этот текст будет отображаться на всем сайте. Его можно использовать, чтобы информировать посетителей о мероприятиях или специальных предложениях!','Store Notice'=>'Уведомление магазина','The maximum allowed setting is %d'=>'Максимально допустимое значение: %d','The minimum allowed setting is %d'=>'Минимально допустимая настройка - %d','Completed product image regeneration job.'=>'Задание по регенерации изображения товара выполнено.','Regenerating images for attachment ID: %s'=>'Регенерация изображений для ID вложения: %s','Select options for &ldquo;%s&rdquo;'=>'Выберите опции для &ldquo;%s&rdquo;','View products in the &ldquo;%s&rdquo; group'=>'Просмотреть товары в группе «%s»','Buy &ldquo;%s&rdquo;'=>'Купить &ldquo;%s&rdquo;','Default category slugUncategorized'=>'Misc','Invalid permission ID.'=>'Недействительный ID разрешения.','Municipality / District'=>'Город/район','%s is not a valid postcode / ZIP.'=>'%s не является действительным почтовым индексом.','Error processing refund. Please try again.'=>'Ошибка при обработке возврата суммы. Повторите попытку.','Limit result set to products with specific SKU(s). Use commas to separate.'=>'Фильтрация товаров по артикулу. Используйте запятые в качестве разделителя.','Download ID.'=>'ID скачивания.','Search logs'=>'Искать журналы','Postcodes containing wildcards (e.g. CB23*) or fully numeric ranges (e.g. <code>90210...99000</code>) are also supported. Please see the shipping zones <a href="%s" target="_blank">documentation</a> for more information.'=>'Индексы с маской (напр. CB23*) или полностью цифровые диапазоны (напр. <code>90210...99000</code>) также поддерживаются. Смотрите <a href="%s" target="_blank">документацию</a> для получения подробной информации.','Shop pages'=>'Страницы магазина','No customer downloads found.'=>'Загрузки клиента не найдены.','Filter by IP address'=>'Фильтрация по IP-адресу','Filter by user'=>'Фильтрация по пользователю','Filter by order'=>'Фильтрация по заказу','Filter by file'=>'Фильтрация по файлу','Filter by product'=>'Фильтрация по товару','Permission ID'=>'ID разрешения','File ID'=>'ID файла','Permission #%d not found.'=>'Разрешение %d не найдено.','Confirm navigation'=>'Подтвердить навигацию','This report link has expired. %1$sClick here to view the filtered report%2$s.'=>'Срок действия этой ссылки на отчет истёк. %1$sЩёлкните здесь для просмотра отфильтрованного отчёта%2$s.','Set Status - On backorder'=>'Установить статус — В невыполненном заказе','View report'=>'Просмотреть отчёт','Customer download log'=>'Журнал загрузок клиента','Copy link'=>'Скопировать ссылку','Copying to clipboard failed. You should be able to right-click the button and copy.'=>'Ошибка копирования в буфер обмена. Нужно щёлкнуть эту кнопку правой кнопкой мыши и скопировать.','Status:'=>'Статус:','Date created:'=>'Дата создания:','Paid on %1$s @ %2$s'=>'Оплачено %1$s в %2$s','Filter by stock status'=>'Фильтрация по статусу','On backorder'=>'Предзаказ','Change status: '=>'Изменение статуса: ','Completed'=>'Завершен','On-hold'=>'На удержании','Payment via'=>'Платёж через','M j, Y'=>'M j, Y','%s = human-readable time difference%s ago'=>'%s назад','Change status to completed'=>'Изменить статус на «выполнено»','Change status to on-hold'=>'Изменить статус на "на удержании"','Change status to processing'=>'Изменить статус на «обрабатывается»','Create your first coupon'=>'Создайте свой первый купон','Existing products that match by ID or SKU will be updated. Products that do not exist will be skipped.'=>'Товары с совпадающими ID или артикулами будут обновлены. Несуществующие товары будут пропущены.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'Для получения обновлений и поддержки по этому расширению, вам требуется <strong>купить</strong> новую подписку, или объединить все расширения на одной учетной записи <strong><a href="%1$s" title="Документация по совместному использованию">совместного использования</a> или <a href="%2$s" title="Документация по переносу">перенести</a></strong> расширение на эту подключенную учетную запись.','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Плагин WooCommerce Helper больше не нужен. <a href="%s">Для управления подписками</a> переходите во вкладку «Расширения».','Webhook topic unknown. Please select a valid topic.'=>'Неизвестная тема вебзацепа. Выберите допустимую тему.','Delete "%s" permanently'=>'Удалить «%s» навсегда','Reasons you\'ll love Jetpack'=>'Причины, по которым вы полюбите Jetpack','Continue with Jetpack'=>'Продолжить с Jetpack','payment setup'=>'настройка оплаты','payment setup and automated taxes'=>'настройки платежей и автоматического налогообложения','Square'=>'Square','Klarna Payments'=>'Платежи через Klarna','Klarna Checkout'=>'Оформить через Klarna','Email address to receive payments'=>'Адрес электронной почты для приёма платежей','Direct payments to email address:'=>'Прямые платежи на адрес электронной почты:','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Безопасно принимайте кредитные и дебетовые карты с единой низкой ставкой, без неожиданных комиссионных сборов (доступны настраиваемые ставки). Продавайте онлайн и в физическом магазине. Отслеживайте продажи и складские запасы в одной точке. <a href="%s" target="_blank">Дополнительные сведения о Square</a>.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Выберите необходимый платёж. Оплатите сразу, позже или по частям. Ни номеров банковских карт, ни паролей, ни волнений. <a href="%s" target="_blank">Дополнительные сведения о Klarna</a>.','Full checkout experience with pay now, pay later and slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Полное оформление заказа при оплате сейчас, при оплате позже и по частям. Ни номеров банковских карт, ни паролей, ни волнений. <a href="%s" target="_blank">Дополнительные сведения о Klarna</a>.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Принимайте дебетовые и банковские карты, поддерживая свыше 135 иностранных валют и разные методы оплаты, например Alipay, и оформляйте заказ одним касанием с помощью Apple Pay. <a href="%s" target="_blank">Подробнее</a>.','I will also be selling products or services in person.'=>'Я буду также продавать товары или услуги лично.','Customer downloads'=>'Загрузки клиента','Revision restored.'=>'Редакция восстановлена.','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'При необходимости здесь можно настроить структуру URL-адресов ваших товаров. Например, если использовать <code>shop</code> (магазин), то ваши ссылки на товары будут выглядеть так: <code>%sshop/sample-product/</code>. Такая настройка относится только к URL-адресам товаров. Она не влияет на другие данные, например на категории товаров.','Move &#8220;%s&#8221; to the Trash'=>'Бросить &#8220;%s&#8221; в мусорку','Attributes let you define extra product data, such as size or color. You can use these attributes in the shop sidebar using the "layered nav" widgets.'=>'Атрибуты позволяют определять дополнительные сведения о товаре, такие как размер и цвет. Эти атрибуты можно использовать на сайдбаре магазина с помощью виджетов «layered nav».','Determines how this attribute\'s values are displayed.'=>'Определяет способ отображения значений этого атрибута.','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'Этот товар продавался и может быть связан с существующими заказами. Вы уверены, что хотите его удалить?','Read more about &ldquo;%s&rdquo;'=>'Прочитайте больше о &ldquo;