iple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.'=>'Пожалуйста, введите префикс для номеров счетов. Если вы используете ваш PayPal аккаунт для нескольких магазинов этот префикс должен быть уникальным, так как PayPal не позволит делать заказы с тем же номером счета.','Invoice prefix'=>'Префикс счёта','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'Опционально можно включить "Передачу данных об оплате" (Профиль > Профиль и настройки > Мои инструменты продаж > Установки сайта) и вставить идентификационный маркер сюда. Это позволит подтверждать платежи без использования PayPal IPN.','PayPal identity token'=>'Маркер идентификации PayPal','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'Если ваш основной email PayPal отличается от введенного выше, то введите ваш основной получатель email здесь. Используется для подтверждения запросов IPN.','Receiver email'=>'Эл.почта получателя','Advanced options'=>'Дополнительные настройки','Enable logging'=>'Включить журналирование','Debug log'=>'Журнал отладки','Enable PayPal sandbox'=>'Включить песочницу PayPal','PayPal sandbox'=>'Песочница PayPal','Please enter your PayPal email address; this is needed in order to take payment.'=>'Пожалуйста, введите свой PayPal email-адрес; это необходимо для совершения оплаты.','PayPal email'=>'Email для PayPal','Pay via PayPal; you can pay with your credit card if you don\'t have a PayPal account.'=>'Оплата через PayPal; вы сможете произвести оплату с помощью банковской карты, если у вас нет аккаунта в системе PayPal.','This controls the description which the user sees during checkout.'=>'Описание, которое видит пользователь при оформлении