анных WC.','Database'=>'База данных','WooCommerce plugins may use this method of communication when checking for plugin updates.'=>'Плагины WooCommerce могут использовать этот метод связи во время проверки обновлений.','Remote get'=>'Удаленный запрос GET','Error: %s'=>'Ошибка: %s','PayPal uses this method of communicating when sending back transaction information.'=>'PayPal использует этот метод связи для обратной отправки информации о транзакции.','Remote post'=>'Удаленный запрос POST','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'GZip (gzopen) используется для открытия GEOIP базы данных из MaxMind.','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'На вашем сервере не обнаружен установленный класс %s, без DOMDocument не работают электронные письма HTML/Multipart и некоторые расширения.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'Электронные письма HTML/Multipart используют DOMDocument для генерации вложенных в шаблоны стилей CSS.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'Некоторые веб-сервисы, такие как служба доставки, используют технологию SOAP для получения информации с отдаленных серверов. Например, отслеживание тарифов FedEx в режиме реального времени требует установки SOAP.','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'Ваш сервер не имеет включенных fsockopen или cURL — PayPal IPN и другие скрипты, которые связываются с другими серверами, не будут работать. Свяжитесь со своим хостинг провайдером.','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'Платёжные шлюзы могут использовать cURL для связи с отдалёнными серверами при авторизации платежей. Другие плагины также могут использовать его для связи с внешними сервисами.','Default timezone is %s - it should be UTC'=>'Временная зона по умолчанию %s — должна быть UTC','The default timezone for your server.'=>'Временная зона по умолчанию для вашего сервера.','Default timezone is UTC'=>'Временная зона по умолчанию — UTC','The largest filesize that can be uploaded to your WordPress installation.'=>'Наибольший размер файла, который может быть загружен на ваш сайт.','Max upload size.'=>'Максимальный размер загружаемого на сайт файла.','The version of MySQL installed on your hosting server.'=>'Версия MySQL, установленная на сервере вашего хостинга.','MySQL version.'=>'Версия MySQL.','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin это мощная система защиты для приложений на языке PHP. Эта система разработана для защиты серверов, во-первых, от широкого набора проблем в PHP приложениях и, во-вторых, от неизвестных уязвимостей как в приложениях, так и в ядре PHP. Если защита включена на вашем сервере, то Suhosin требует дополнительной настройки в увеличении допускаемых данных.','SUHOSIN installed'=>'Установлен SUHOSIN','The maximum number of variables your server can use for a single function to avoid overloads.'=>'Максимальное количество переменных, которое ваш сервер может использовать для одной функции чтобы предотвратить перезагрузку.','PHP max input vars'=>'Количество входящих параметров в запросе PHP','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'Количество времени (в секундах), которое ваш сайт будет тратить на отдельную операцию до истечения срока (для избежания зависаний сервера).','PHP time limit'=>'Ограничение времени выполнения PHP','The largest filesize that can be contained in one post.'=>'Максимальный размер файла, который может содержаться в одной записи.','PHP post max size'=>'Максимальный размер запроса PHP','The version of PHP installed on your hosting server.'=>'Версия PHP, установленная на сервере вашего хостинга.','PHP version.'=>'Версия PHP.','Information about the web server that is currently hosting your site.'=>'Информация о сервере, на котором размещён ваш сайт.','Server info.'=>'Информация о сервере.','Server environment'=>'Окружение сервера','The current language used by WordPress. Default = English'=>'Используемый язык WordPress\'а. По умолчанию = Английский','Language'=>'Язык','Displays whether or not WordPress is in Debug Mode.'=>'Включён ли режим отладки ядра сайта.','The maximum amount of memory (RAM) that your site can use at one time.'=>'Максимальное количество памяти (RAM), которое ваш сайт может использовать единовременно.','Whether or not you have WordPress Multisite enabled.'=>'Включена ли мультисайтовость вашего WordPress\'а.','The version of WordPress installed on your site.'=>'Версия WordPress, используемая на вашем сайте.','Several WooCommerce extensions can write logs which makes debugging problems easier. The directory must be writable for this to happen.'=>'Некоторые расширения WooCommerce могут вести журналы, которые облегчают отладку. Указанная директория должна быть перезаписываемой, чтобы это было возможным.','Log directory writable'=>'Каталог журналов доступен для записи','The version of WooCommerce installed on your site.'=>'Версия WooCommerce, установленная на вашем сайте.','The root URL of your site.'=>'Корневой URL вашего сайта.','WordPress environment'=>'Окружение WordPress','Copy for support'=>'Скопировать информацию для поддержки','Understanding the status report'=>'Понимание статусного отчёта','Get system report'=>'Получить системный отчет','Please copy and paste this information in your ticket when contacting support:'=>'Пожалуйста скопируйте эту информацию для предоставления нашей службе поддержки:','There are currently no logs to view.'=>'Сейчас здесь нет журналов для просмотра.','Download &amp; install'=>'Скачать и установить','Read all about it'=>'Почитать об этом','Storefront is an intuitive, flexible and <strong>free</strong> WordPress theme offering deep integration with WooCommerce and many of the most popular customer-facing extensions.'=>'Storefront — это не только интуитивная, гибкая и <strong>бесплатная</strong> тема WordPress, глубоко интегрированная с WooCommerce, а также множество популярных клиентоориентированных расширений.','We recommend Storefront, the <em>official</em> WooCommerce theme.'=>'Мы рекомендуем Storefront, <em>официальную</em> тему для WooCommerce.','Looking for a WooCommerce theme?'=>'Ищете тему с поддержкой WooCommerce?','Our catalog of WooCommerce Extensions can be found on WooCommerce.com here: <a href="%s">WooCommerce Extensions Catalog</a>'=>'Вы можете найти наш каталог расширений WooCommerce на сайте WooCommerce.com: <a href="%s">Каталог расширений WooCommerce</a>','Free'=>'Бесплатно','Marketing'=>'Маркетинг','Need a theme? Try Storefront'=>'Нужна тема? Попробуйте Storefront','Itemized'=>'По позициям','As a single total'=>'Как один итог','Display tax totals'=>'Отображение итогового налога','Define text to show after your product prices. This could be, for example, "inc. Vat" to explain your pricing. You can also have prices substituted here using one of the following: {price_including_tax}, {price_excluding_tax}.'=>'Определите текст, отображаемый после цен на ваш товар. Например это может быть "Без НДС". Вы можете заменить здесь цены переменными: {price_including_tax}, {price_excluding_tax}.','Price display suffix'=>'Суффикс цены','Display prices during cart and checkout'=>'Отображение цен в корзине и при оформлении заказа','Excluding tax'=>'Исключая налоги','Including tax'=>'Включая налоги','Display prices in the shop'=>'Отображение цен на товары','Additional tax classes'=>'Дополнительные налоговые классы','Round tax at subtotal level, instead of rounding per line'=>'Округление налога на уровне подытога, а не для каждой позиции','Rounding'=>'Округление суммы','Shipping tax class based on cart items'=>'Рассчитывается на основе товаров в корзине','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Определяет какой налоговый класс используется для доставки. Оставьте пустым для использования индивидуальных ставок для каждого товара в корзине.','Shipping tax class'=>'Класс налога на доставку','Customer billing address'=>'Платёжный адрес клиента','Customer shipping address'=>'Адрес доставки клиента','This option determines which address is used to calculate tax.'=>'Определяет какой адрес будет использоваться для расчёта налога.','Calculate tax based on'=>'Основа для рассчёта налога','No, I will enter prices exclusive of tax'=>'Цены указываются без учёта налогов','Yes, I will enter prices inclusive of tax'=>'Цены указываются с учётом налогов','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Данная опция имеет важное значение, так как она определяет каким образом будут вводиться цены. Изменение не влияет на существующие товары.','Prices entered with tax'=>'Включение налога в цены','Enable taxes'=>'Включение налогов','Save webhook'=>'Сохранить вебзацеп','Updated at'=>'Обновлено','Created at'=>'Создано','Webhook actions'=>'Действия вебзацепа','Secret'=>'Секрет','URL where the webhook payload is delivered.'=>'URL, по которому доставляется нагрузка вебзацепа.','Enter the action that will trigger this webhook.'=>'Введите действие, которое вызовет этот вебзацеп.','Action event'=>'Событие действия','Custom'=>'Произвольно','Action'=>'Действие','Product deleted'=>'Товар Удален','Product updated'=>'Товар Обновлен','Product created'=>'Товар создан','Order deleted'=>'Заказ Удален','Order updated'=>'Заказ Обновлен','Order created'=>'Заказ создан','Customer deleted'=>'Клиент удалён','Customer updated'=>'Клиент обновлён','Customer created'=>'Клиент создан','Coupon deleted'=>'Купон Удален','Coupon updated'=>'Купон обновлён','Coupon created'=>'Купон создан','Select when the webhook will fire.'=>'Выберите, когда эта вебзацеп должен быть задействован.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'Параметры: &quot;Активно&quot; (доставляет нагрузку), &quot;Приостановлено&quot; (не доставляется), or &quot;Выключено&quot; (не доставляется по причине проблем с доставкой).','Friendly name for identifying this webhook, defaults to Webhook created on %s.'=>'Читабельное название для идентификации данного вебзацепа. По умолчанию: Вебзацеп создан %s.','Webhook data'=>'Данные вебзацепа','Method'=>'Метод','Tax name'=>'Название налога','State code'=>'Код области','Country code'=>'Код страны','No row(s) selected'=>'Строка(и) не выбраны','Import CSV'=>'Импорт CSV','Remove selected row(s)'=>'Удалить выбранную строку(и)','Insert row'=>'Вставить строку','Tax rate ID.'=>'ID налоговой ставки.','Choose whether or not this tax rate also gets applied to shipping.'=>'Относится ли налоговая ставка к услуге доставки.','Choose whether or not this is a compound rate. Compound tax rates are applied on top of other tax rates.'=>'Укажите, является ли данная ставка сложной. Сложные налоговые ставки применяются поверх других налоговых ставок.','Compound'=>'Сложение','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'Выберите приоритет для этой налоговой ставки. Используется только