e out of stock notifications'=>'Включить оповещения об окончании запасов','Enable low stock notifications'=>'Включить оповещения о малых запасах','Notifications'=>'Оповещения','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'Удерживать на складе (для неоплаченных заказов) до x минут. Когда лимит времени достигнут, ожидающий заказ будет отменен. Оставьте пустым, чтобы отменить.','Hold stock (minutes)'=>'Удержание запаса (мин.)','Enable stock management'=>'Включить управление запасами','Manage stock'=>'Управлять запасами','Enable AJAX add to cart buttons on archives'=>'Включить Ajax для кнопки добавления в корзину из архивов','Redirect to the cart page after successful addition'=>'Перенаправить в корзину после успешного добавления','Add to cart behaviour'=>'Автопереход в корзину','Sort by price (desc)'=>'По цене (убывание)','Sort by price (asc)'=>'По цене (возрастание)','Sort by most recent'=>'Упорядочить по последним','Average rating'=>'По среднему рейтингу','Popularity (sales)'=>'По популярности (продажи)','Default sorting (custom ordering + name)'=>'Стандартная сортировка (порядок добавления + имя)','Default product sorting'=>'Исходная сортировка товаров','Show subcategories'=>'Показывать подкатегории','Show products'=>'Показывать товары','Shop page display'=>'На странице магазина','This sets the base page of your shop - this is where your product archive will be.'=>'Установка основной страницы вашего магазина — здесь будет располагаться архив товаров.','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'Эта основная страница также может использоваться для <a href="%s">постоянных ссылок на товар</a>.','Shop page'=>'Страница Магазина','Integration'=>'Интеграция','This sets the number of decimal points shown in displayed prices.'=>'Определяет количество знаков после целого, в отображаемых ценах.','Number of decimals.'=>'Количество десятичных знаков.',