int for the "Checkout &rarr; Order received" page.'=>'Эндпоинт страницы «Оформление заказа &rarr; Заказ принят».','Order received'=>'Заказ принят','Endpoint for the "Checkout &rarr; Pay" page.'=>'Эндпоинт страницы «Оформление заказа &rarr; Оплата».','Pay'=>'Оплатить','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'Эндпоинты добавляются к URL вашей страницы для обработки определенных действий в процессе оформления заказа. Они должны быть уникальными.','Checkout endpoints'=>'Эндпоинты оформления заказа','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Если на сайте определена страница "Условий", то клиент должен будет принять их перед оплатой заказа.','Terms and conditions'=>'Правила и условия','Checkout page'=>'Страница оформления заказа','Cart page'=>'Страница корзины','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Эти страницы нужны для того, чтобы система могла перенаправлять пользователей к оформлению заказа.','Force HTTP when leaving the checkout'=>'Принудительно использовать HTTP после оформления заказа','Force secure checkout'=>'Принудительная защита оформления заказа','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'При использовании нескольких купонов, применять первый купон к полной стоимости, второй купон к уже сниженной и так далее.','Calculate coupon discounts sequentially'=>'Рассчитывать скидки купонов последовательно','Coupons can be applied from the cart and checkout pages.'=>'Купоны могут быть применены на страницах корзины и оформления заказа.','Enable the use of coupon codes'=>'Включить использование купонов','General options'=>'Основные настройки','Account creation'=>'Создание аккаунта','Endpoint for the triggering logout. You can add this to your menus via a custom link: yoursite.com/?customer-log